(2101, 'Happiness, Do you Know its Address?', 'View Point', 'Fatima Fazal Abbasi', '1', 'Human life is full of struggles. From birth to death, we are striving hard to achieve something. Imagine a seven-year-old boy, who has an exam after two days and he is feeling so tense and burdened. Now visualize a university student who must submit his final year project after a week, he is working day and night to complete all his work. After getting education, we want to achieve a good job and again put in all our effort to get a job. Our journey of struggle does not end after achieving our dream job, rather we then start striving to get promotions and finally, when we are settled in our j ob, our next goal is to provide a luxurious life to our children, enlighten their minds with quality education and assist them to be settled in their lives.\r\n\r\nAll humans, no matter which socio-economic background they belong to, are trying in their own unique way for making their lives free of pain and full of pleasure. We are made to believe that financial gains and social status is the source of our pleasure or happiness. We rely on these external things to make our life blissful but as they are not in our control, thus instead of freeing us and making us happy, this belief traps us in an endless loop to keep us chasing after a false promise while the “happiness ” we’re laboriously slaving for slips farther away from our grasp.\r\n\r\nToday I will give you the right address of happiness. As we know that, in this universe, the location of everything is defined by space and time. Same is the case with happiness, it is also defined by space and time. As far a s spatial location is concerned, our happiness resides within us all. The time where happiness exists, is present.\r\n\r\nTo extract happiness from within, we have to introduce ourselves with the concept of self -love. Self-love means being satisfied with ourselves, accepting our flaws and imperfections, being kind and gentle with ourselves and forgiving ourselves for all the mistakes that we’ve ever made. But the question here is, why is self-care important? Imagine yourself in a situation where there seems to be no ray of hope and there is no one to listen to you or to keep you calm. Then there is only one person with you, that is your own self. If you have a positive self-image about yourself and know your self-worth, then you will have the belief that “I can overcome this situation” and you will focus on the solution. This constructive approach will bring positivity that will help you fight with the grim situation without conscious effort. On the contrary, if you have a negative self-belief, then you will underestimate yourself, blame yourself for being stuck in this problem, and your mind will be so involved in such thoughts that you will not be able to think of any solution and will depend on others to help you. Such thoughts will make you miserable. They will lead you to pain and suffering that is opposite of happiness. So, we should always be satisfied with ourselves, love and take care of ourselves and it can automatically lead us to happiness.\r\n\r\nThe other important factor that can be a source of happiness is living in the present moment. Painful memories of the past and fear of the future cause frustration which leads us toward dissatisfaction. There is a need to understand this fact that neither our worry and stress can change the past nor future-anxiety can prevent future problems rather it is just destroying our present and affecting our peace of mind. We have no control either on past or future but we have power only to control the present as it is still in our hands and we can make it memorable and wonderful. So, we should live in the present, enjoying each and every blessing that we have with gratitude and be optimistic about the future.\r\n\r\nThus, life is short and unpredictable and we do not know how and when it will end. We should try to make each and every moment memorable for ourselves and those around us and obviously it is not possible without being contented with ourselves and without living in the present moment. When we will be happy and joyful, this happiness and joy will emanate from us and will fill everything and everyone around us. On the contrary, if we spend our life struggling and striving and believing that our happiness depends on external things and it lies somewhere in future or in memories of the past, then we won’t get anything other than dissatisfaction and disappointment. These negative emotions will not only engulf our lives but they will cast their shadows on lives of those who are connected with us.', 'The views expressed in the article are the author’s own and do not necessarily reflect our editorial stance.', 'alirehman@admin.ims', , '2020-12-16 18:47:28', 100),
(2102, 'Stepping Into Digital World – Good Or Bad?', 'Technology', 'Mahnoor Kasif', '2', 'The enhanced trends of digitization have been shifting us into a fast-paced world where emotions of happiness, anger, sadness, liking are expressed with nothing other than an emoji. Your friend passed an exam which you got to know while scrolling through some social media application let’s say Facebook. In most cases, you would not feel any kind of profound feeling. But you will surely congratulate her by commenting on her Facebook announcement. Then you scroll down further and receive the sad news of someone’s demise. You still do not feel emotion. But again, you reply with a sad emoji.\r\n\r\nToday there is hardly any child who does not spend his/her spare time watching YouTube videos. In fact, children these days know all the technicalities of electronic gadgets. The results are obviously bad eyesight, impaired creativity, a revulsion for social mingling resulting in most children becoming introverts. But there is another aspect that is never mentioned. The lost childhood fun. When these children would grow up, a look back at their childhood would give them nothing but glimpses of YouTube videos.\r\n\r\nThere has been a tremendous decline in children’s various activities. I remember playing with my neighbors in street various games like “Ready-go”, “Pakran-Pakraai”, “kabaddi-kabaddi”, “Haathi-soond” and many more such games. Then the game of Name-Place-Thing. Playing Ludo with a lot of “Dhandali” (cheating).\r\n\r\nThese games were not merely games. They taught us many lessons. We learned how to socialize with friends? How to accept defeat? How to behave after winning a game? How to compensate friends who were not proficient enough for a certain game? How to settle disputes? How to escape the class barriers and play without any discrimination with all the children of the street?\r\n\r\nBut in our new generation, I see a dearth of basic tolerance. Maybe we can attribute this to the growing digital trends. These days children are losing basic tolerance and the ability to cooperate with each other. One cannot negate the perks of digital technology in the modern world. But one should also be careful with their use especially in case of children because they are at the learning stage of their life and care must be taken so as to prevent technology from thwarting their learning faculties.', 'The views expressed in the article are the author’s own and do not necessarily reflect our editorial stance.', 'alirehman@admin.ims', , '2020-12-17 18:49:57', 99);
INSERT INTO `blogs` (`BlogID`, `Title`, `Category`, `Author`, `AuthorID`, `Blog`, `Disclaimer`, `Admin`, `Pic`, `Date`, `Views`) VALUES
(2103, 'A Compelling Book Review Of “Homo Deus”', 'View Point', 'Mahnoor Kashif', '2', '“Having reduced mortality from starvation, disease and violence, we will now aim to overcome old age and even death itself. Having saved people from abject misery, we will now aim to make them positively happy. And having raised humanity above the beastly level of survival struggles, we will now aim to upgrade humans into gods, and turn Homo sapiens into Homo Deus. ”\r\n\r\nThe above lines seem to be an excerpt from some future-predicting Science- fiction movie where a group of scientists are shown to be experimenting with human beings to convert them into some form of Super humans. A two to three hours long movie that you enjoy with pop-corns and family. But when it comes to believe them you just cannot. But here, Harari starts with the most imaginative and fictional idea that you can only suppose to be true in your wildest dreams. He further constructs on this idea. He proceeds, as if continuously creating sand dunes and then perishing them then constructing again. He makes you shift your thoughts from one idea to another and then fin ally taking you to His idea. He proves all these ideas with unquestionable arguments. You have a question in your mind to challenge his idea and as you read further, there he is, with an answer to your doubts.\r\n\r\nThe book starts with “The Human Agenda” where humanity is personified as a human being waking up in third millennium from a long sleep and observing today’s agenda. Here, Harari starts the story of Human civilization, the problems it used to face and future promises. How problems of today have changed as compared to the past ones. How Humans have learnt to co-ordinate with each other. The reality of death and our struggles to defeat it. How Humans used to pray before their own created gods with firm belief. Then he makes you question, “Are there any brakes of the vehicle in which the humanity is moving?” What is its destination ? Where will it stop and shout, ‘Yes! Today, we have achieved it. ‘ Now we can take rest, have a look at our creation and penalize our mistakes. But the cycle continues. So, what is new to the menu? Evolution has always been a major determiner on Earth. Man plays the key factor in evolution. But today, Man has got the power to evolve even nature. He will be the one to pave way for Super-humans who will eventually replace him.\r\n\r\nThe book is divided into three parts. The first part is “Homo Sapiens Conquers the World”. Here he questions the Human superiority over all species of animals. He questions certain human beliefs and explains their logic. He also proves that there is no such thing as Emotion. In fact, there are all algorithms that help us in making a decision.\r\n\r\n“Even Nobel Laureates in economics make only a tiny fraction of their decisions using pen, paper and calculator; 99 per cent of our decisions- including the most important life choices concerning spouses, careers and habitats – are made by the highly refined algorithms we call sensations, emotions and desires.”\r\n\r\nHe also debates the difference between mind and brain, the legitimacy of laboratory experiments and most importantly, cooperation among human beings. Harari proves his point by citing some historically significant evidences. There is also thoughtful discussion on meanings. What is the magic spell that gives so much power to a piece of paper as to finish wars and annihilate countries?\r\n\r\nThe second part is “Homo Sapiens Gives Meaning to the World “. Here he argues how Humans have given meaning to this world through their self-created stories. Stories that made them believe in gods or Kings in past and various Brands in present. The influence of these stories is so much so that they have given meanings to our reality, our struggles an d even our existence. The invention of writing revolutionized the entire Human society by preserving the stories, saving records (and manipulating) and most significantly, the Holy scriptures that proclaim to contain “the answers to all our questions”. In the words of Harari,\r\n“Written language may have been conceived as a modest way of describing reality, but it gradually became a powerful way to reshape reality. ”\r\n\r\nThe third and the last part, “Homo sapiens loses control . Here he questions the directions of technology and where will it lead us? Technology is continuously giving meaning to our lives. But the question arises, is this meaning beneficial or harmful? We are stepping into a society where electronic gadgets know us better than our own parents. So, may be these gadgets will one day surpass us and take hold of the world. This evolution will be the same as that of vehicles where we replaced horses with engines. Similarly, soon there will be a time when machines will replace humans.\r\n\r\nThe book ends with a thought-provoking advice. Harari says, “Today having power means knowing what to ignore.” Today, when we are facing the problems of pandemic, power imbalance, terrorism, disharmony, inequality and many more issues, the need of the hour is to focus on the “immediate problems” to quote the words of Harari.\r\n\r\nThis book is a must read in these days where times are changing fast and we are stepping into an age of digital revolution. The world is becoming more and more digital. Harari provides significant insights into the way technology works and how the world is changing.', 'The views expressed in the article are the author’s own and do not necessarily reflect our editorial stance.', 'faizaliaqat@admin', , '2020-12-17 18:52:09', 103),
(2104, 'Need for adaptive learning in educational institutes', 'Education', 'Muhammad Ali Falak', '3', 'TRADITIONAL pedagogies, abhorrence to innovation and obsolete curriculum obstructs schools and varsities from meeting the demands of the industry. Employers lament the lack of critical thinking and leadership in the interviewees. Students complain what they learn in schools is boring, theoretical and unrewarding. Stronger than any Bollywood love triangle is the hate triad of students, educational institutes and industry in Pakistan.\r\n\r\nFirst and the Second industrial revolution in Britain, continental Europe, North America, and Japan triggered mass production in the industry - requiring the standardized model of direct learning widely used in mainstream education today. Educational institutes then aimed at generating the uniform talent to fill process-based early manufacturing jobs where innovations, critical thinking and creativity were not a priority. \r\n\r\nThis prevalent mode of learning in schools inspired by the initial industrial revolutions produce unproductive minds for the jobs of today and tomorrow. The process-based-learning and misalignment of the students, schools and industry gravely hamper the country’s anticipation to tap its youth potential.  Not trained to find creative solutions to real-world problems there remains little hope that the current education system will enable students to capture a market share of e-commerce and the IT industry in the future world – something Pakistan is aiming for with its 5G technology. \r\n“I have spent more than three million on my bachelor’s degree but still looking for a decent job, government jobs are shrinking and the competition is increasing day by day,” said Saad who graduated three years ago in Computer Science from a private university in Lahore. His father used his retirement fund to finance his son’s education. Since then, Saad has been working in a call-center as a telemarketing agent, unable to land a job matching his qualification.\r\n\r\nThere are a large number of students like him who despite having a degree fail to impress employers. Either their degrees are not relevant to the job market or they do not have acquired the right skill-set during their school years. Whenever an opportunity strikes, these fresh graduates underperform. ‘Government jobs’ remain the only option where performance is not the discriminating criteria for progress. For jobs requiring out-of-box thinking like teaching and policy-making, these graduates of process-based-learning prove to be the worst.\r\nIn the class teachers deliver knowledge to the students by demonstrations – arriving at a particular answer by using formulas, equations and fundamentals. Students’ role is limited to memorize and imitate for solving other similar problems. Whatever learning happens is accidental. Generally, grades are what matters the most – not the skills. Now, for many parents in Pakistan; sending kids to school has become a futile exercise; it is a ritual for the rest with no return for their hard-earned investment. Suffering is inevitable.\r\n\r\nIn the past, many international technological and automobile giants have turned down their plans of opening manufacturing plants in Pakistan because of the unavailability of the required talent. Instead, they opted for India and Bangladesh where the educational institutes produce graduates meeting the demands of the industry.\r\n\r\nTo foster creative thinking the way forward needs a two-fold strategy: the shift from the ‘process-based learning’ to ‘problem-based learning’ and concurrent objectives of the stakeholders: schools, students and the industry. \r\nComparing both the models. In a process-based learning; teaching to calculate the volume of a cylinder to the class will involve memorizing the formula and using it for different sizes of the cylinders. Contrarily, a problem-based approach will require students to design a cylinder; having a volume sufficient enough to store the drinking water for a small town in summer while preventing excessive evaporation. An open-ended problem like this enables students to be innovative without the pressure of reaching a single answer.\r\n\r\nOn the other hand, educational institutes must focus on the individual learning traits of the students. Adaptive learning technology must be incorporated to analyze each student’s skill level and develop personalized learning pathways for them. Schools must focus on the skill development and learning outcomes rather than the grades which only measure the ability to parrot details and reproduce them.\r\n\r\nSchools need to be proactive as they prepare students for jobs that even do not exist at the moment. Educational institutes must ensure that they produce graduates that can fulfill the demands of the industry currently and in the future. Education policymaking must be more than political point-scoring and needs to be visionary unlike the past. ', 'The views expressed in the article are the author’s own and do not necessarily reflect our editorial stance.', 'alirehman@admin.ims', , '2020-12-19 23:52:34', 214);
