(2105, 'Why female child seems burden in patriarchal society?', 'Education', 'Mehmil Khalid Kunwar', '4', 'In times of ignorance, a girl when born was not even allowed to take few breaths and buried by her male guardians in order to avoid shame (associated with the birth of a female child) or escape the burden of her existence. The brutal tradition, however, got obliterated, following the teachings of Holy Prophet (PBUH) but, unfortunately, the old traces of such ignorance, in other forms, are still existing today. In a society as that of Pakistan where Islam is being misused in settling most of the social affairs and family dealings, mistreating a girl and depriving her of her major rights are no exception.\r\n\r\nRight from the day when a girl is born, she is being realised that she is inferior to her male counterparts and has to compromise on all the decisions of her life. Be it her father, brother, husband, or a male relative, she has to keep her voice low at all the family occasions and is not allowed to express her emotions loudly and enthusiastically. She has to adjust herself according to the environment that her family prefers and at times, has to give up on her dreams in order to fulfil their expectations. If she is found fighting off the cultural taboos overcoming her intrinsic fears, she has to face criticism not only from the society but also from her family members especially her paternal side (as most South Asian families are against a girl\'s liberty and independence).\r\nIn a male dominant society, a girl feels nothing less than a burden upon her family or perhaps someone who always brings misery from the day she acquires her existence. Given the existing gender gap in all the social sectors, parents have to struggle enough to satisfy her needs especially providing her basic education and getting for herself a safe shelter. Luckily, if they desire to make her a self-sufficient person working independently, they literally have to walk on the heated coals to maintain her reputation in the society and guard her chastity owing to the prevalence of unwise social practices and no provision of expected justice. Most of the parents, as a consequence, do not seek daughter as a child so that they can easily avert the double burden - a burden to raise her and to protect her virginity.  \r\n\r\nConsidering a girl as a \"burden\", parents often want to marry her at a very early age due to societal pressure and under the pretext of \"discharging their responsibilities on time\" without letting the girl complete her education and attaining enough maturity. The curse of dowry has also made them dispose of her in marriage as early as possible as they fear they might get short of money with time to satisfy the materialistic needs of her in-laws, hence, face disgrace. Contrarily, this is not the case for a male child. With having a son in parallel, parents feel more blessed and are found to invest happily on him because they think he will support the family, bringing both money and a girl, after his marriage and it is comparatively better to spend more on him in order to ensure a safe social and financial return while daughters on the other hand, have to leave their house one day so it would be a half-witted idea to invest on her growth and wellbeing. It is a common sight in the mainstream society where having a son means gaining \"izzat and fakhar\" and having a daughter means acquiring \"boojh or zillat\". Perhaps, that is why most Pakistani couples are found reproducing more and more in greed of having more number of sons than daughters.\r\nTo undo this social behaviour that has been widely reinforced in our personalities since decades, there is a need to change the mindset of people. It is high time to spread awareness and make people realise that \"girls are NOT a burden\" and should not be treated likewise. Parents at home, and teachers in the school, should make a part of their upbringing the criteria to make both men and women learn the \"rights\" of women and strive to introduce the concepts of \"mutual tolerance\" and \"mutual respect\" when working together. Social environment should be favourable so that a girl can easily work on her dreams without getting threatened from any side. The practice to treat a girl as a burden should be discouraged on every platform as this kind of behaviour does not exist in developed countries, where women feel empowered and motivated to pursue their dreams and careers even after getting married. The reason why our country is lagging behind in various economic sectors is because our women are trapped inside a bubble of \"social inequality\" where men do not allow them to come forward and prove their worth on equal footing. This bubble should be immediately burst in order to liberate women from the prison of such patriarchal thoughts that hinder their excellence.\r\nBeing the \"queen\" of her house or the \"angel\" in the family, she is truly a great \"blessing\" and owes an extremely sacred position in the society. While rejecting the notion that \"she is a burden\", she must be given that place without her begging for it.', 'The views expressed in the article are the author’s own and do not necessarily reflect our editorial stance.', 'faizaliaqat@admin', , '2020-12-21 23:57:10', 199);
INSERT INTO `blogs` (`BlogID`, `Title`, `Category`, `Author`, `AuthorID`, `Blog`, `Disclaimer`, `Admin`, `Pic`, `Date`, `Views`) VALUES
(2106, 'Is there social media crackdown?', 'Technology', 'Sulman Ali', '5', 'At the end of September, news started circulating that Federal Investigation Agency (FIA) is launching an FIR against 49 journalists in Islamabad. The reports stated that the cases are registered under Prevention of Electronic Crimes Act’s Article 37, which deals with ‘unlawful online content’. The journalists took this news very seriously, as days before an FIR was registered against Asad Toor for posting “negative propaganda against the state, Pakistani institutions and the Pakistan Army\". \r\n\r\nThe media reports suggested the names like Murtaza Solangi, Ammar Masood, Umer Cheema and Azaz Syed are included in the ‘list’ of journalists. The reports further claimed that FIA sources have confirmed that development, but didn’t reveal the name of journalists. However, they stated that mostly social media activists are included in the list. \r\n\r\nCondemning the news, Pakistan Federal Union of Journalists (PFUJ) expressed serious concerns. President PFUJ Shahzada Zulfiqar and Secretary General Nasir Zaidi asked the government to immediately withdraw these cases. “Otherwise, there will be a countrywide protest against such brutal and ill conceived fictitious charges,” he said. \r\nThe head of PFUJ urged Supreme Court, international community and Amnesty International to take immediate notice of worst working conditions for journalists and media in Pakistan. However, Minister for Human Rights Shireen Mazari rejected the reports. She stated that a private citizen had sent complaint to FIA against around 12 journalists. “FIR is investigating the complaint, but no FIR has been registered,” she said. The minister was responding to the Human Rights Commission, which said it is “alarmed” over this news. \r\n\r\nMeanwhile, South Asia Amnesty International also condemned the act, stating that: “Intimidating journalists through the draconian Pakistan Electronic Crimes Act is the latest and most brazen attack on freedom of expression in the country. Reacting to this, Federal Minister for Science and Minister Fawad Chaudhry said, “Those who raised hue and cry without confirmation must now apologise to the government and the nation.” \r\nBy the look of it, the FIA didn’t take any action against the journalists. However, the fear expressed by journalists’ bodies is not to be ignored. In the last few years, the media freedom has been facing a crackdown in Pakistan. There are number of cases, where the journalists have been targeted by the state, or the news websites banned in last few years. The curbs on press freedom are proved by Pakistan’s Press Freedom Index 2020, where the country has dropped to 145 from 142 last year. This shows that over the past year, threats against journalists have increased. \r\n\r\nObservers say this ‘strong grip’ against media doesn’t stop at the print or electronic media, and it has spread to social media. The latest case of country’s increasingly strict cybercrimes law was the ban on TikTok. The app, immensely popular among the youth, was the mean of entertainment for millions, including the poor. In a statement, Pakistan Telecommunication Authority (PTA) said that ban has been imposed, “in view of number of complaints from different segments of the society against immoral/indecent content on the video sharing application TikTok.” Critics say that although the ‘objectionable’ content in stage dramas and Pakistani films continues, yet, the authority took the step against this app. The ban was overturned on Monday, but conditions over ‘immodesty’ remain.\r\nIn another sign of increasing issues against social media, the Lahore High Court raised the question on “YouTube channels being created without proper mechanism.” During the hearing of a case on non-removal of objectional content from social media, the court expressed agitation over channels being launched across the country. “Under which law are YouTube channels running and who monitors the content [on the video-sharing platform]?” the court asked. \r\n\r\nExperts note that the clampdown on media and social media is not new in Pakistan. Almost every government has either stopped the airing of content against the rulers, and has bannedsocial media sites including YouTube. \r\n\r\nObservers believe that the major reason behind this is the fear over sentiments of the masses, believing that many are ready to take offence rather quickly, which results in a ban on anything contentious. \r\nExperts note that educating the society about the freedom of speech is essential, because if people will not protest against such steps by the state, progress will be difficult. They reiterate that the people should be broadminded and take steps for freedom of speech.', 'The views expressed in the article are the author’s own and do not necessarily reflect our editorial stance.', 'faizaliaqat@admin', , '2020-12-24 00:23:11', 150),
(2107, 'Look At The Bright Side!', 'View Point', 'Amna Noreen', '6', '“Centuries passed and still the same, War in our blood, some things never change. Fighting for land and personal gain, better your life, justify our pain. The end is knocking.”\r\n\r\n“Lost” lyric from Avenged Sevenfold truly reflects the present state of humanity. Negative Thoughts have become our asset and it is this negativity that is swallowing up the positive aspects. Our words are actually very important not only for those who hear, but for ourselves as well. The habit of being negative influence our actions. We are actually fond of looking at the darker side, thinking of failure before trying, demotivating others, focusing on difficulties and hardships and do not thinking of something positive that might occur or will actually occur.\r\n\r\nSuccess and failures are part of life, every successful person has failed somewhere, but learning from the failures is the only difference between a successful and failed person. To achieve success one must develop motivation, determination and positivity.\r\n\r\nPositive thinking is a mental attitude that admits into the thoughts that are conductive to growth and success. It is our thinking that expects good or bad results. Whatever we think, we find it actually. Not everyone has the ability to remain positive in every situation. A positive mind gets a successful and favorable outcome of every situation.\r\n\r\n“Nothing is Impossible”, this sort of thoughts needs to be developed. Every small or big, easy or complex problem have its solution, the only requirement is determination, confidence and hard work to find the solution.\r\n\r\nPower of Positivity helps turning dreams into reality and avoiding stress and depression. Bo Bennett rightly said:\r\n\r\n“Having a positive mental attitude is asking how something can be done rather than saying it can’t be done.”\r\n\r\nThe Question then is How to Stay Positive. Optimism is something to strive for, there are various ways through which one can stay determined and positive:\r\n\r\n• Look for Something Positive in a Negative Situation\r\nIn every situation, there is something good. Most of the time it’s not obvious, we have to look. And sometimes we have to look hard.\r\n\r\n• Begin Everyday with Optimism\r\nOne must start day with positive affirmation, motivate yourself and must have good hopes for the whole day.\r\n\r\n• Think of Failures as Lessons\r\nNo one is perfect, everyone makes mistakes and experience failure many times. A successful person is the one who learn from his mistakes and turn failure into lessons.\r\n\r\n• Get Rid of Past and Focus on Present\r\nOne must focus on the present, the past cannot be undone. Living at the present moment is extremely important. Being in the present moment means that we are aware and mindful of what is happening at this very moment. We are not distracted by deliberations of the past.\r\n\r\n• Have a Positive Company\r\nOne must stay in the company of Positive people. Negative attracts Negative, remaining in a positive company affects the way of thinking and one can achieve positive outlooks and affirmations.\r\n\r\n• Learn to Take Criticism in a good way\r\nOne of the most common fears is the fear of criticism. It can hold people back from doing what they want in life. One must take criticism in a healthy way and learn from it.', 'The views expressed in the article are the author’s own and do not necessarily reflect our editorial stance.', 'alirehman@admin.ims', , '2020-12-29 16:57:11', 211);
INSERT INTO `blogs` (`BlogID`, `Title`, `Category`, `Author`, `AuthorID`, `Blog`, `Disclaimer`, `Admin`, `Pic`, `Date`, `Views`) VALUES
(2108, 'Will Imran ever play for the people of Pakistan again?', 'National', 'Waqas Shabbir', '7', 'There is a saying in politics, never let the good crises go to waste. This is Imran’s chance to get his house in order. Governance crises and gross mismanagement of the economy have become the hallmarks of the incumbent regime. \r\n\r\nImran’s government has been more about unleashing verbal attacks on the opposition, ensuing witch-hunt, and less to do with solving the issues of the general public. The prevailing dire circumstances irked the public and offered an old-guard an opportunity to kick-start a renewed attack at the current system—hoping to create enough stir and turmoil, forcing its backers to look at other options. \r\n\r\nNawaz has dodged the establishment. He defied the expectations number of times and miffed quite a few people in the process. His decision to return from exile in Saudi Arabia raised quite a few eyebrows. He managed to do it again, when he returned from London and got arrested, and ably used the sympathy vote, particularly in Punjab, and thwarted Imran’s plan, under the watchful eye of the establishment. Nawaz is at it again. He left the country—being too poly to be treated in the country. And, now after recovering under mysterious circumstances, he has gone after the establishment and Imran’s government all guns blazing. \r\nThe rising public dissent against the government over inflation provided the divided opposition a perfect opportunity to make an alliance and compromise on party ideologies and unite on a single-point of restoration of democracy. \r\n\r\nLiberals (PPP) are compromising, Rightists (PML-N) are compromising, Far-rightist (JUI-F) are compromising, and many others extreme lefts following the suite, all for what, to make a coalition of instability, anarchy, and chaos. It is an incredible journey from a coalition of stability (2009-2018) to a coalition of instability (2020). The only party not willing to compromise on so-called accountability is PTI, despite compromising on most of its election pledges. As if PTI’s politics of vengeance was not enough, this 11-party coalition has created an unprecedented uproar within the establishment after a series of rallies, demanding ousting Imran and his backers. \r\n\r\nThe political profession is at a cross-roads in the country. Politics in Pakistan is getting messier and dirtier by the day. The callous, unkind, and foul-mouthed politicians have stained the profession. The pointless and unsolicited political statements have become the norm of the game.\r\nThe selfish individuals have wrecked up the country along with the opportunists in the civil and military establishment.  The strongmen of Pakistan, be it in politics or military, have dismantled the very fabric of the society in one way or another. \r\n\r\nThe civil servant used to be free to make judgments based on professional ability and little interference from politicians. The constitution guaranteed security of tenure, and arbitrary dismissal was unlikely.  \r\n\r\nZulfikar Ali Bhutto abolished the CSP’s and brought new service, merging them into 22 grades, making way for cronies to become the civil servants. It was the start of decay. The culture started in the 1990s of loyal and party-linked civil servants spread like wild fire leading to economic and social mayhem. Most of the bureaucrats working in Punjab and Islamabad worked with the house of Nawaz, and despite not in government, they continue to have clout within the bureaucracy in Punjab and Islamabad. \r\nNow the system is rotten to the core. The incumbent government regularly bemoans the systematic weakness and strong allegiances of bureaucracy with the PML-N and PPP. \r\n\r\nInexperienced within PTI ranks is not an understatement. On every other issue, when PTI loses control, Imran, in either an interview or speech, confesses to mistakes. Apologies are not enough, and bemoaning the systematic bottlenecks such as on import of wheat on time is not enough. \r\n\r\nImran’s urban middle class and rich voters are questioning his tactics. The majority may not have turned against him as yet. But he must prepare for the worst when he says if Pakistan holds elections today, he will come out victorious. He is gravely mistaken. This crisis brings an opportunity for Imran to put his house in order. The opposition is reeling on him, and unless there is another, well-orchestrated Remote Transmission System (RTS) break down, his chances to retain the power remain minimal. \r\nImran—who posed as a revolutionary and liberator of some kind, looking to follow some heterodox ideas, had to swallow a bitter pill. Now, he’s adamant that the public must follow suit.\r\n\r\nEveryone knew the riding would be hard under the inexperienced anchor, and those who believed in him must pay the price for their false conviction. Amidst all this drama, public confidence in the system is evaporating. The level of tolerance is diminishing, and the political class is fast losing the respect of the public. Imran must realize this and reach a compromise for the larger interest of this country. As the crisis of economy and governance deepens, it’s time to change tactics and play for the people, not against them.', 'The views expressed in the article are the author’s own and do not necessarily reflect our editorial stance.', 'faizaliaqat@admin', , '2020-12-31 17:01:53', 170);
INSERT INTO `blogs` (`BlogID`, `Title`, `Category`, `Author`, `AuthorID`, `Blog`, `Disclaimer`, `Admin`, `Pic`, `Date`, `Views`) VALUES
(2109, 'Dark Side Of Media Is Actually The Dark Side Of People!', 'Media Logs', 'Amna Noreen', '6', 'A peculiar war has recently started on social media and among the people of Pakistan, its sometimes encouraging and sometimes criticizing, sometimes Pakistani artists are praised and sometimes they are condemned, which results in entangling of social media users with each other.\r\n\r\nIn such a situation, an important question arises that is where Pakistan’s film and drama industry is heading and what is the viewpoint of audience. They criticize some particular content and on the other hand they keep on watching the same content.\r\n\r\nHow can a Production House or Channel stop airing the most watched content, or how can writers stop writing plots which are gaining the highest TRPs?\r\n\r\nOn one side, we all use to say that our media is promoting un-Islamic and immoral content, then why are we watching it?\r\n\r\nWhy Not we Stop watching that Content?\r\n\r\nWhy Not we Stop Promoting that Content?\r\n\r\nMedia shows what actually People want to Watch. It has been seen across the country that if PEMRA or PTA bans some shows or applications, public starts protesting against the ban. There have been a number of Dramas and Shows made with a Positive perspective of Islamic values and Pakistani culture, but they are not watched, even they don’t get satisfied ratings.\r\n\r\nThen what the whole discussion is about?\r\n\r\nIt is said that media shapes the mentality, but looking today our media is totally spoiling every youngster and children. Means the loop is just moving continuously, a blame game is being played, public blames media and media says we show what public wants. Then who is responsible? In short, both, the clap doesn’t ring with one hand, both public and media needs to review themselves. Media plays an important role in nourishing the mindset of people, it must have a positive perspective towards religion and culture and a sense of patriotism towards the nation. Similarly, the public and audience must remain strong in their opinion as their words does matter.\r\n\r\nBecause the Dark side of Media is actually the Dark side of People.', 'The views expressed in the article are the author’s own and do not necessarily reflect our editorial stance.', 'faizaliaqat@admin', , '2021-01-02 17:02:58', 250);
INSERT INTO `blogs` (`BlogID`, `Title`, `Category`, `Author`, `AuthorID`, `Blog`, `Disclaimer`, `Admin`, `Pic`, `Date`, `Views`) VALUES
(2110, 'Protest For Uighur Muslims', 'Global', 'Syeda Sana Rasool', '8', 'LAHORE: Friends of Uighur Muslims have arranged a demonstration to demand that alleged atrocities against them should end in China.\r\n\r\nSpeaking to the protesters, Maulana Ahed Bilal, Ziaul Islam, and Samiul Haq alleged that Uighur Muslims are facing atrocities in China. They said that these Muslims are not allowed to perform their religious rituals freely and are forced to eat un-Islamic food. They said these Muslims are not allowed to perform Hajj and say their prayers.\r\n\r\nThey said Uighurs are not allowed to give their children Muslim names. They further alleged that China has been keeping two million Muslims in torture cells, and this issue should be discussed in OIC.  They said that they will keep on the rising voice in favor of Uighur Muslims in all cities of Pakistan.\r\n\r\nIt is pertinent to mention here that Uyghurs are an ethnic Muslim minority living in east and central Asia. Around 11 million of these Turkic Muslims make half of the population of China’s Xinjiang province, which is the country’s biggest region spanning over 1.6 million km square, bordering with Central Asian countries.\r\n\r\nIn the name of a crackdown on religious extremism, China has been capturing, detaining, and torturing millions of Muslims in internment camps since 2017. China, however, rejects allegations, saying that the facilities are vocational ‘concentration camps’ to re-educate and train Muslim ethnic minority groups for their rehabilitation and redemption in its attempt to fight terrorism and religious extremism.', 'The views expressed in the article are the author’s own and do not necessarily reflect our editorial stance.', 'faizaliaqat@admin', , '2021-01-05 17:17:55', 180);
INSERT INTO `blogs` (`BlogID`, `Title`, `Category`, `Author`, `AuthorID`, `Blog`, `Disclaimer`, `Admin`, `Pic`, `Date`, `Views`) VALUES
(2111, 'Three Act Spectacle', 'National', 'Sulman Ali', '5', 'Our PDM has chosen the protagonists of the movement, the main characters. Maryam Nawaz was lucky to be selected. Indeed, so was Bilawal Bhutto. They form a perfect pair, imagining the political reincarnation of their parents – individually of course, since the two were archenemies.\r\n\r\nPerhaps, Bilawal has selected a more sensible political partner than the other way around. Maryam is more mature and she displayed her wisdom in Gujranwala, Karachi and Quetta. \r\n\r\nThe three rallies have been eye openers, a new beginning, for those who long for a better political spectacle. \r\n\r\nThere is also a play within the play, where Bilawal perhaps propagated the arrest of Mr Safdar before a mid-break, or intermission. It added new flavour to the spices of the ‘11 masala chaat’ as they have been declared. \r\n\r\nFor us, in the audience, it remains an intriguing fantasy, wherein we immerse ourselves — the pleasure looting nation that we are. \r\n\r\nDipping down their talent, they were able to assign a minor role to Hamid Mir as well, where he was entangled with the youngsters, as none of the scheduled leaders could reach the Jinnah Stadium in Gujranwala on time.\r\n\r\nNevertheless, they were able to gather the masses for the spectacle that they were dying for.\r\n\r\nThey arrived quite late. The Milky Way had arrived to welcome the new actors to plan to act on the stage of humanity. They were received with open arms.\r\n\r\nBoth protagonists spoke well on the occasion, with right connotations, showing a Promised Land where people would lead their dreams. No sanatorium, this time we plan to build parks and playgrounds on Olympians patterns where sophists would stretch themselves before they encounter each other for a question and answer session.\r\n\r\nMeanwhile, one has to follow hygiene habits like staying safe and distant, not necessarily just for the pandemic. We could yet create a society based on better laws that reduces the power distances.\r\nBilawal reflects BB all of the time, and Maryam resonates Nawaz. She reminds us of when her father utters hard-hitting punches, but softly. She reminds us of her soft-spoken father who represented Pakistan thrice. It is a sheer pleasure and delight to know that his Orange Train has taken her first flight over the weekend.\r\n\r\nLet us move forward with youngsters. We need the youth to show the path. Let the smart young stride. Let there be a light that omits through the youth. Those who know how to carry designer dresses and use appropriate apps.\r\n\r\nI remember a time where one wouldn’t know the difference between long distance calls and regular calls, where one could not remember simple area codes. One hesitated to take flights because one did not know how to fasten seatbelts.\r\n\r\nWho would be with this age band where they can’t even check their own mail or navigate basic routes? For how long are we going to stale ourselves with oldies? \r\n\r\nI don’t want to take names. I just want the youth to step up on the deck – be that a ship deck or a stage where they could echo the dreams of their ancestors in a better way. Being more organised, they can bring a better change in the nation’s life span. \r\nI remember writing a short poem for Imran Khan in 1992 when he fought for the cup: please don’t confine your capability, for mere sport activity.\r\n\r\nI can hardly deny his charisma and his international presence. No one can. He is doing wonders in the things that he can. But we do dream of these two stepping forward to climb up the ladder as successfully and fast as they can.\r\nI remember writing a short poem for Imran Khan in 1992 when he fought for the cup: please don’t confine your capability, for mere sport activity.\r\n\r\nI can hardly deny his charisma and his international presence. No one can. He is doing wonders in the things that he can. But we do dream of these two stepping forward to climb up the ladder as successfully and fast as they can.', 'The views expressed in the article are the author’s own and do not necessarily reflect our editorial stance.', 'faizaliaqat@admin', , '2021-01-10 17:26:09', 180);
INSERT INTO `blogs` (`BlogID`, `Title`, `Category`, `Author`, `AuthorID`, `Blog`, `Disclaimer`, `Admin`, `Pic`, `Date`, `Views`) VALUES
(2112, 'Goodbye Trump!', 'Global', 'Bahadur Ali Khan', '9', 'The incendiary politics of US president Donald Trump has finally been laid to rest. In an election year, had he shown some empathy with the grieving blacks instead of converting their pain into agitation or only if he resisted his insatiable impulse to speak without weighing his words, results could have been different for him.\r\n\r\nThe spread of the Covid plague could have been turned into an opportunity only if he showed modest respect for science. He could have avoided openly flouting the precautions and displayed himself as a responsible leader. People look up to their leaders regardless of political affiliations, especially during times of crisis. But he did it all wrong - on every count. But still, he provided a close contest. Let\'s examine how.\r\n\r\nTrump though criticized for his apparent imbecile actions by the mainstream media and global intelligentsia but he still was secretly admired by many as well. For many people, he was a go-getter. A man of his words, right or wrong is a different debate. For them, he would not sugarcoat his words or hid behind vague diplomatic lingua, that generally never makes sense to the masses. Also, he was the one who provided considerable buoyancy to the US economy. He insisted on keeping US jobs for Americans instead of outsourcing those. He kept capital markets protected from anything that could torpedo the ascent of their indexes. However, this also turned out to be a double-edged sword for him. Though he helped markets, his fixation with these, also irked many. Super rich became mega-rich.\r\nHe wanted to take the US out of global trade agreements that were enacted, in the past, by the Americans themselves. He also questioned the \'free defense\' offered to Western Europe under the umbrella of NATO. He didn\'t realize that under the hoop of big defense treaties, an entire populace of beneficiaries takes birth. And those beneficiaries would pick any kind of fight, necessary to protect their privileges. And Trump would provide them with enough ammunition through his erratic impulses only to be get ridiculed himself. And we always noticed that most of the public scorn that was directed towards him wasn\'t about his policies but his personal (funny) habits and nudges he would occasionally give to his opponents.\r\n\r\nTrump brought fundamental changes to the perpetually chaotic Middle East. He prevailed upon the fundamentalist and dried up the cash flow lines for ISIS in Syria and Iraq, that eventually brought an end to one of the biggest human tragedy that was taking place in our times. His focus remained business but tried to do things on his own terms. His body language actually proved to be a catalyst in the transformation of most conservative Arab regimes that eventually started finding ways to ease up on the social freedoms that were unheard of before. Also to his credit, he initiated no new wars anywhere in the world rather tried to wrap up the existing ones. Thus a bit of peace, not to everyone, but to most was felt.\r\nSuch actions on domestic and especially on the foreign front were however interpreted as a weakness on the part of the US. It gave rise to the impression of a diminishing global power in the world. Many took it as the US is decimating its role in global affairs and eventually may turn out to be just another typical rich Western country, just like erstwhile global empires like the UK or France. Such impressions give rise to global power vacumes that eventually get filled by the others. And if those \'others\' turn out to be those whom the US was engaged militarily or through other means of embattlement then the power center could gravitate adversely. And could hurt US economic interests in the long run. He perhaps also be also liked on these accounts by his political opponents and allies, in some cases, because to them it was like caving in. A sign of weakness!\r\n\r\nTrump\'s dismantling of international environmental treaties earned him the wrath of a new voter\'s category. The Millenials, who were brought up with all the awareness of the deteriorating environment of our planet were simply in a state of shock. For them, regardless of the jobs, he created for them, they simply couldn\'t live with the fact that their leadership could be so callous about such a genuine issue. And it wasn\'t only confined to Millenials but anyone who understood the impact of such thoughtless actions. However, this deprived Trump of a big number of urban and semi-urban young voters in the Swing states.\r\nDonald Trump, notwithstanding, his short-comings would be remembered for running the most \'happening\' and colorful presidency. His penchant for staying in the news and the acts he would do to achieve that would always be quoted and dug out of political archives over and over, in the future. The big media houses would now again have to resort to a comparatively dull presidency. A career politician like Joe Biden may not be able to provide the necessary sizzling items for the journalists to work with. They would be attending presidential briefings with open-ended, vague, and diplomatically rich words. So they perhaps miss Trump for that matter \'dearly\'. However, for a better part, now when someone cries for \'I can\'t breathe..\', he might find some listening ears!', 'The views expressed in the article are the author’s own and do not necessarily reflect our editorial stance.', 'alirehman@admin.ims', , '2021-01-10 17:31:04', 200),
(2113, 'Watching Mr. Bean In A Third World Country!', 'Media Logs', 'Mahnoor Kashif', '2', 'I grew up watching the comedy series of Mr. Bean. I used to be too much engrossed in watching, that I forgot since what time had I been watching. The character of Mr. Bean was well-played by the actor. I and all those watching it obviously enjoyed the funny acts of Mr. Bean. But there was something else that appealed me. I could not recognize it in my childhood. But now, whenever I think about it, I can better understand my feelings.\r\n\r\nThe thing that appealed to me was the delights of living in the first world. Well-dressed people walking in exhibitions, clean and airy roads, little amenities of life that everyone could enjoy, tasty pastries that Bean could buy from a road-side hawker (at least here in the third world we call him by this name) just by paying some coins. There was an idea of comfort that I enjoyed watching. The comfort arising from consumerism.\r\nThe kind of comfort that I couldn’t find in a third world country. Soon there came a time when I watched Mr. Bean not as a comedy serial but as a travelogue series that let me see a first world country. Which country, I did not know and did not even care to know. I just fulfilled my aesthetic appeals by watching it.\r\n\r\nNow when I have grown up enough to identify the differences between a developed and under-developed country, I realize that I was appealed towards the consumerism of the first world. The idea of lavishness. I could identify the differences that exist between countries. This never let me enjoy the series to the full. I used to see people laughing out loud on comedy acts of Mr. Bean but I could never enjoy the series in that way.\r\n\r\nThere was a sore in my heart that had developed due to friction of these differences. This sore still resides there and now yearns for more soreness rather than cure. The inequality that exists in the world has been there since always and will be there forever. The minor differences that used to exist in economies are now extending and increasing, creating gaps that will take forever to fill up.\r\n\r\nThe soreness, the friction that is there makes me question the realities. It keeps me alive and shows me the mirror. It helps me to perceive reality. And most of all, it never lets me satisfied. After all, how can a sane mind be satisfied in such a set of circumstances?\r\n\r\nBut one thing will remain the same forever, one side of the world will remain the show-stopper forever and one side will always be the audience. Now I think of Mr. Bean as a metaphor for the superpowers who make the world laugh through their amusing acts. But such acts often turn out to be disadvantageous for themselves instead of anyone else.', 'The views expressed in the article are the author’s own and do not necessarily reflect our editorial stance.', 'faizaliaqat@admin', , '2021-01-12 21:35:51', 180);
INSERT INTO `blogs` (`BlogID`, `Title`, `Category`, `Author`, `AuthorID`, `Blog`, `Disclaimer`, `Admin`, `Pic`, `Date`, `Views`) VALUES
(2114, 'Living Nations Don\'t Compromise!', 'Education', 'Amna Noreen', '6', 'Plato said, “The direction in which education starts a man, will determine his future life.”\r\n\r\nHow true he said! Coming to the present situation, Government decided to close all educational Institutes for almost two months again due to COVID outbreak. But the reaction of Students was not amazing but alarming. What a nation we are and what we are producing for future. Closure of Educational Institutes is a decision made by the Ministry of Education due to the Situation but Students are celebrating and taking it as a Joke.\r\n\r\nClosing of educational institutes is not something worth celebrating. We don’t take things and issues seriously, that’s how we are aiming for Change.\r\n\r\nSecondly, Why only educational institutions.? Why No park or mall is closed? Non-important activities which should be closed, Public Parks, Malls, Restaurants, Play Grounds are still open but they matter actually, education does not.\r\n\r\nMany institutes in Pakistan aren’t efficient enough with online learning, many students do not have access to good connectivity internet, many parents can’t afford smart devices for each of their children and now all of them are going to suffer. But the celebrations indicate that our students have not yet been educated, how far they are running from education. They are not aware of their good or bad future, they are acknowledging the destruction of their careers and future.\r\n\r\nQasim Ali Shah, a well renowned inspirational speaker said,\r\n“If students are still happy with the closure of educational institutions, we must understand that they have only been taught books so far not been educated.”\r\n\r\nWe need to understand the ferocity of this situation. Too, morally corrupt nation we’re. From waiting for the so-called happiness of vacations, sharing of memes on this issue, we need to grow up. The slogans in favour of corona has depicted the real face of so called future of this nation.\r\n\r\nMoreover, we must remember the faces of the students who are celebrating holidays today, tomorrow they will be seen protesting for unemployment.\r\n\r\nLiving nation don’t compromise on education but in this scenario, we’ve declared ourselves as dead souls which are waiting for to be buried by illiteracy.\r\n', 'The views expressed in the article are the author’s own and do not necessarily reflect our editorial stance.', 'faizaliaqat@admin', , '2021-01-12 22:47:17', 308);
INSERT INTO `blogs` (`BlogID`, `Title`, `Category`, `Author`, `AuthorID`, `Blog`, `Disclaimer`, `Admin`, `Pic`, `Date`, `Views`) VALUES
(2140, '\r\nSocial Media Is Smokes And Mirrors!', 'Technology', 'Waqas Shabbir', '7', 'Social media is a double edge sword. You all the know the drill of social media, uploading pictures, status, sharing stories and commenting. Social media has allowed us to transfer a copious amount of information that will ultimately lead to progress and quantifiable change. But it’s kind of a red herring towards reality. It has the ability to make a silk purse out of a sow’s ear.\r\n\r\nSocial media is all about creating an idealized version of oneself and hence escaping the reality. We need to understand that every human on this earth is not utterly enjoying life and if their social media implies otherwise then they are lying. What people show online is not entirely true. Not everyone is on cloud nine.\r\nIf someone has posted a perfect picture of having fun that doesn’t mean they are not passing through their boring routines. Behind every perfect photo, there are thousands of not so perfect photos. Basically, putting up the collection of the best and brightest moment in social media is too stressful.\r\n\r\nFor e.g. you just saw a picture of your friend enjoying at the beach. Now you eat your heart out and think that why am I not on the beach? Why am I not enjoying my life the way she is? What you just missed from that photo is that she spent an hour to take photos, looking for the perfect view, moving from one place to another just to get a perfect shot, dressed up to the nines just to get colorful picture and posing in different ways to look natural. Then selected the best one, posted it and missed enjoying the moment in staging photos just to get admiration from the people she barely knows.\r\n\r\nThere are billions of other examples related to the reality show on social media that people think they are directing and acting. From joining gym and posting a photo with a treadmill saying #fitnessgoals, when in reality you don’t run on a treadmill for more than five minutes. Posting a healthy meal picture, when in reality you ate pizza #Healthylifestyle. Putting up makeup, taking million selfies, editing it with filters and posting it on your social media saying #nofilter #wokeuplikethis.\r\n\r\nPeople are really making a mountain out of a molehill to live their lives to be aesthetically pleasing across social media. It’s all Greek that one lives a life of peaches and cream. Next time you think that someone’s life is better than yours, think twice because it’s all smoke and mirrors.\r\n\r\nYou all are familiar with the function of currency and in social media these likes, comments and sharing stories are the currency by which we assign value to something. You are the product in social media. When you spent an hour to edit a photo and you put it on the social media, you are basically allowing others to value you. You are like a sitting duck, waiting for the people to tell you your worth.\r\nSometimes you meet with people to take pictures, when in reality you just don’t want to see them. People are sitting at dinners and their heads are buried in their phone, WHY? They took a photo and now they are thinking of the best caption for it and getting into anxiety. This photo is the validation of you being socially active with your friends and family.\r\n\r\nWe take our product off the shelf when it’s not selling. Same is the case with humans, you posted a picture and if that picture doesn’t give you above 500 or maybe 1000 likes, you take it off. You need to understand that beauty is only skin deep, you can’t let others decide who you really are. Not everyone is going to like you and not getting likes or comments doesn’t make you any lesser than anyone else.\r\n\r\nWhat people are not understanding is that it’s not the social media which is causing the trouble, it’s the dark side of people. Social media is just illuminating the darker side of people. Once you have recognized the problem, you can fix it.\r\n\r\nNine times out of ten you spent two hours on social media and you get under someone’s spell. You start to think they are in the seventh heaven. HERE you need to nip this problem in the bud and for that you have to adopt audit social media diet. Just like you examine carefully everything before you eat, here you have to audit what goes in your head. Unfollow pages that is making you delusional. Unfriend people who are just faking everything and making you feel less special. Social media is a great way to connect but know that not everything is as it seems to be.\r\nCreate a better online experience for yourself. Follow people who inspire you to become a better version of yourself, follow actors as they do provide you entertainment, follow pages of religion as they are the way to peace. In short follow those who brings the best out of you. You are spending almost two hours every day on social media and you should feel better, motivated and inspired when you get offline.', 'The views expressed in the article are the author’s own and do not necessarily reflect our editorial stance.', 'alirehman@admin.ims', , '2021-01-13 13:57:37', 120);
