(2141, 'Why Is History Important?', 'View Point', 'Sayeda Rana Rasool', '8', 'History is the knowledge of and study of the past. It is the story of the past and a form of collective memory. History is the story of who we are, where we come from, and can potentially reveal where we are headed. History is important to study because it is essential for all of us in understanding ourselves and the world around us. There is a history of every field and topic, from medicine, to music, to art.\r\n\r\nHistory gives us a very clear picture of how the various aspects of society — such as technology, governmental systems, and even society as a whole — worked in the past so we understand how it came to work the way it is now. Studying history allows us to observe and understand how people and societies behaved. For example, we are able to evaluate war, even when a nation is at peace, by looking back at previous events. History provides us with the data that is used to create laws, or theories about various aspects of society.\r\n\r\nHistory can help provide us with a sense of identity. This is actually one of the main reasons that history is still taught in schools around the world. Historians have been able to learn about how countries, families and groups were formed, and how they evolved and developed over time. When an individual takes it upon himself to dive deep into their own family’s history, they can understand how their family interacted with larger historical change. Did family serve in major wars? Were they present for significant events?\r\n\r\nHistory helps us to understand present-day issues by asking deeper questions as to why things are the way they are. Why did wars in Europe in the 20th century matter to countries around the world? How did Hitler gain and maintain power for as long as he could? How this had an effect on shaping our world and our global political system today?\r\n\r\nIf we want to truly understand why something happened — in any area or field, such as one political party winning the last election vs the other, or a major change in the number of smokers — you need to look for factors that took place earlier. Only through the study of history can people really see and grasp the reasons behind these changes, and only through history can we understand what elements of an institution or a society continue regardless of continual change.\r\n\r\nHistory can help us become better informed citizens. It shows us who we are as a collective group, and being informed of this is a key element in maintaining a democratic society. This knowledge helps people take an active role in the political forum through educated debates and by refining people’s core beliefs. Through knowledge of history, citizens can even change their old belief systems. By looking at specific stories of individuals and situations, you can test your own morals and values. You can compare it to some real and difficult situations individuals have had to face in trying times. Looking to people who have faced and overcome adversity can be inspiring. You can study the great people of history who successfully worked through moral dilemmas, and also ordinary people who teach us lessons in courage, persistence and protest. The study of history is a non-negotiable aspect of better citizenship. This is one of the main reasons why it is taught as a part of school curricula. People that push for citizenship history (relationship between a citizen and the state) just want to promote a strong national identity and even national loyalty through the teaching of lessons of individual and collective success. We learn from past atrocities against groups of people; genocides, wars, and attacks. Through this collective suffering, we have learned to pay attention to the warning signs leading up to such atrocities. Society has been able to take these warning signs and fight against them when they see them in the present day. Knowing what events led up to these various wars helps us better influence our future. The skills that are acquired through learning about history, such as critical thinking, research, assessing information, etc., are all useful skills that are sought by employers. Many employers see these skills as being an asset in their employees and will hire those with history degrees in various roles and industries.\r\n\r\nUnderstanding past events and how they impact the world today can bring about empathy and understanding for groups of people whose history may be different from the mainstream. You will also understand the suffering, joy, and chaos that were necessary for the present day to happen and appreciate all that you are able to benefit from past efforts today. In the study of history you will need to conduct research. This gives you the opportunity to look at two kinds of sources — primary (written at the time) and secondary sources (written about a time period, after the fact). This practice can teach you how to decipher between reliable and unreliable sources. History gives us the opportunity to learn from others’ past mistakes. It helps us understand the many reasons why people may behave the way they do. As a result, it helps us become more impartial as decision-makers.\r\n\r\nAll people and cultures are living histories. The languages we speak are inherited from the past. Our cultures, traditions, and religions are all inherited from the past. We even inherit our genetic makeup from those that lived before us. Knowing these connections give you a basic understanding of the condition of being human.\r\n\r\nThe subject of history can help you develop your skills and transform you to be a better version of yourself as a citizen, a student, and person overall.\r\n\r\n', 'The views expressed in the article are the author’s own and do not necessarily reflect our editorial stance.', 'alirehman@admin.ims', , '2021-01-13 14:03:24', 97);
