(2144, 'Benefits Of Proper Diet And Exercise!', 'Health', 'Amna Noreen', '6', 'Just as life is a great gift from Allah Almighty, so is good health an invaluable gift of nature. Fitness plays an important role in taking full advantage of the joys and pleasures of life. Only a healthy person can fully enjoy the blessings and pleasures given by Allah Almighty. Someone has said that health is a thousand blessings. The system of nature has devised an automated system in our body to protect our health and maintain our bodies.\r\n\r\nA never-ending series of diseases and healing of the human body continues all the time. Inside the human body, an automated immune system is always active, which automatically eliminates many diseases that occur in our body. For example, our mouths produce a lot of germs every day that are very harmful to various organs and especially our hearts. But when a person walks fast and when he opens his mouth to breathe fast, many dangerous germs are killed as a result. It is as if proper exercise gives our body countless benefits that are not usually known to us.\r\n\r\nResearch seems to prove that as the person becomes old his arteries harden and began to create hurdles in his veins. Hardening of the arteries can also lead to heart disease. Light exercise not only softens the muscles and clears the mind, but also enables the veins to dilate more. Therefore, proper exercise should be made a routine of life. For older people, just walking around the house may be enough.\r\n\r\nEvery human being wants to live a healthy life with his loved ones. A good and proper diet, along with many other factors, is essential for living a healthy life. Therefore, a diet that is full of nutrients should be part of your daily life. The human body needs water, protein, carbohydrates, vitamins, and minerals daily for better growth. Therefore, one should try to use the same food which is prepared according to the principles of hygiene.\r\n\r\nFor good health, if one lives by keeping some basic things in mind, one can avoid many complications. For example, cleanliness and hygiene are very important for the good development of human health. Eating and drinking times, work, and balance in work and eating a balanced diet can be very beneficial for human health.\r\n\r\nHealthy eating does not mean that a person eats full plates and does not leave room for breathing. Some people pay a lot of attention to meat, while a burger of beef a week or a large stack of meat a month is considered important for the human body. You can also eat some fish and chicken once a week. The rest of the protein the human body needs should be supplemented by vegetables. Fruits and vegetables should be an essential part of our diet. Proper use of all the different things that nature has created for us can be useful in maintaining human health. Therefore, instead of consuming more than one thing, you should eat a variety of foods so that the body gets the nutrition it needs.\r\n\r\nA study shows that a diet rich in fiber is very useful for humans. Researchers say that the human diet should include 25 grams of fiber per day, while 30 grams of fiber is more appropriate. Fiber naturally lowers the risk of diseases such as heart attack, stroke, and diabetes. It also helps control weight, blood pressure, and cholesterol levels. Fiber can be obtained from fruits, vegetables, bread, pasta made from peeled grains, pulses, fruits, and seeds. A normal-sized banana contains about three grams of fiber. Half a cup of barley contains 9 grams, a large slice of brown bread 2 grams, a cup of cooked lentils 4 grams, cooked potatoes with peels 2 grams, a carrot 3 grams, apples with peels 4 grams of fiber.\r\n\r\nOur health is related not only to our bodies but also to our emotions. Anger and lack of control over one’s emotions can be harmful to the human body. Therefore, one should try to keep one’s thoughts pure. Just as jealousy consumes virtues, it also harms the human body. Therefore, adopt good morals and avoid bad morals as it can be extremely useful for human health and its soul. Consumption of pure and wholesome food produces pure and righteous blood in the body, which in turn creates purity in human ideas, thoughts, and intentions, which also affects the human soul. So use pure food for the purification of your soul and the health of your body. Incorporate pure words and positive attitudes into your thoughts, intentions, and ideas so that our body and our soul become pure.', 'The views expressed in the article are the author’s own and do not necessarily reflect our editorial stance.', 'faizaliaqat@admin', , '2021-01-16 14:15:17', 122);
