(2145, 'Hyderabad: A City Where History Unfolded Many Stories...', 'Life Style', 'Muhammad Ali Falak', '3', 'Long to investigate something more than we might suspect yet don’t have the foggiest idea what to investigate, drive to the city of Muslim heads Hyderabad where history addresses the present. We as a whole have alternate points of view about history some simply take it as a period that passed and some accept it as a good and some live in it on account of their fascination towards verifiable spots and these landmarks talk about their significance itself.\r\nNotwithstanding how swarmed and little lanes one constantly struck by the old structures and tombs which uncovers their residency story to the individuals who visit them. The structures are old, not in their unique structure yet pulls in the individuals who cross them while going anyplace in the city.\r\nremarkable when Ghulam Shah Kalhoro appreciated the city and requested a stronghold to be assembled called Paka Qilla and built up Hyderabad as a capital of his domain in 1768, Kalhora tradition rule over Sindh for two additional decades. In any case, in this century just the remnants of “Pakka Qila” left as broken blocks.\r\n\r\nSubsequently, the Talpurs who succeeded Kalhoras in the skirmish of Halani became the leader of Sindh. Talpurs made numerous new urban communities in Sindh and made Sindh an autonomous state from the outside association in authentic issues. To make their administration greater, they battle with Rajputs and made Umerkot a piece of their legislature. Talpur’s residency was finished after the skirmish of Miani in which British powers succeeded.\r\n\r\nGhulam Shah Kalhoro and the incomparable Talpurs who administered over Hyderabad for a long time and construct Hyderabad as a monetary state covered in principle Hyderabad; the city of numerous societies and dialects.\r\n\r\nTheir tombs plan with great structural work and making who uproariously talk their residency to guests.\r\nWhile contemplating Talpurs Government in Sindh a name consistently shows up as the main priority “Hosh Muhammad Sheedi” a notable character in Sindh well known to his trademark “Marvesoon Par Sindh Na Desoon“.\r\n\r\n(Sindhi:) “We will pass on however not offer Sindh to other people” A man had a place with African successor Sheedi people group in Sindh joined the military of Talpurs. The Talpurs named him as their military general. His adoration and devotion for Sindh was uncommon and still recollect for his amazing dauntlessness. He faced in a conflict of Miani with supreme bravery and boldness that even while battling when he had proclaimed martyred the British got dread from his dead body and the British armed force General Sir Charles Napier appreciated with his fortitude and paid a tribute to him and covered him with full military distinctions.\r\n\r\nA flyover named after Hosh Muhammad Sheedi and his reproduction/Monument close Gol constructing consistently pushed the guests back to history to consider his grit, duty his affection for Sindh and how individuals come and gone however their names alive until the end of time. Most likely he was the man who will consistently recollect with his grit.\r\n\r\nAs I would like to think the soul dies from this world, yet their positive or negative acts left in this world as history. History uncovered the tales of individuals who act exceptionally in regular circumstances.', 'The views expressed in the article are the author’s own and do not necessarily reflect our editorial stance.', 'alirehman@admin.ims', , '2021-01-16 14:18:08', 100),
(2146, '5 Reasons To Visit Sialkot...', 'Life Style', 'SUlman Ali', '5', 'To get your own Telstar-18 FIFA football, you just have visit ‘Forward’ sports outlet in the city. It costs Rs 3000 for the real thing. While you are there, buy a CA cricket bat, a grey’s field hockey, ultra-fine leather gloves, and a leather bomber jacket. All this for Rs 20,000 tops! You can also get ultra-light, rust free, surgical tools in case you have the pathological need to carve someone up. The place is heaven for sports gears of Nike, Adidas, Puma etc. — because this city exports it to the world. This year Sialkot exported $ 2 Billion worth of goods that includes rice, leather, instruments, and sports stuff. If you are kicking around a Telstar football right now, know that it was probably prepared at Sialkot. Pakistan is at No. 201 in FIFA ranking but no one builds balls better than us — or bagpipes. All clothing brands including Levis, Eden Robe, Cotton & Cotton etc. have opened a shop there. It’s a shopper’s paradise.\r\n\r\nShah Wala Teja Singh Hindu Temple, at the center of the city, still has the Hindu deities carved on its pillars. The one I saw looked like Jagannath – hence, the name Jagannath temple. It is a majestic structure — probably built with a lot of religious devotion. This is the only temple in Pakistan that has a Greek look to its architecture — especially the Columns and arches. Could this Greek influence be because Macedonian Alexander leveled old Sialkot city in 326BC? There is another Hindu temple in the old city called the Ragunath Temple that houses a government school and is well preserved. Another Sikh Temple Babay Di Ber Sahib is still functional. This points to the multi-ethnic society of Sialkot. History says Greeks were followed by Buddhist, then Hindus, Mughals, Pathans’, Sikhs and then British in lording over the city. The odd thing is that there was a very limited non-Muslim population here in 1947 — the reason for this is still unexplained. Sialkot Fort has long been demolished but the higher fort ground overlooking the city remains.\r\n\r\nFor other Hindu temples in Pakistan, check out Kalyan, Kishan and Lal Kurti Temples.\r\n\r\nVisit to Pooran Da Khoo,  a 20 minutes’ drive from Sialkot, reminds me of the Story of Prince Pooran, whose limbs were amputated by his father, the Raja of Sil-kot, for allegedly assaulting his beloved first wife — several centuries ago. The hapless mutilated prince was thrown into the well at kror and left to die. A Hindu hermit pulled him out and let him preach there as a sadhu too. A Hindu temple was built there in honor of the sadhu prince and he was buried in its courtyard. There is no evidence of any tomb at the site, but prince Pooran still lives in Punjabi lore.\r\n\r\nSialkot Cantonment was built by the British between two rivulets – meant to act as natural defenses on two sides. The streams have long dried up. Now that the city has grown, it appears in-between Ravi and Chenab rivers. The only reason for the British to build such a well-equipped cantonment here was to keep an eye on the Strategic Jammu road — just in case, the Dogra Sarkar of Kashmir gets adventurous. Jammu is a stone throw away (44 Kms). Sialkot Cantt is a sight for sore eyes. Even the present day Sialkot city is clean, well maintained, green and beautiful. All the roads of the city, that includes Cantt, have been recarpeted by the exporter community there in a 50:50 deal with the government. Sialkot is probably the cleanest city of Pakistan after Lahore. Sialkot has remained as the winter capital of Kashmir as well for the Dogra and the British representative of Kashmir. The fertile lands and ample water all around has produced green gold for their owners for centuries. Sialkot’s rice is exported all over the world. The city of Sialkot has been awarded Hilal e Istiklal for their gallantry in 1965 war. Sialkot’s fortunes declined initially after independence when it was severed from Jammu and it’s trading cities that ended up with India.\r\n\r\nHead Marala, irrigation headworks is situated at an hour’s drive from the city. It diverts Chenab river water to two irrigation channels. It also produced 20 MW electricity. It is a bird sanctuary and a picnic area. It is a lovely place to go to except for the occasional dead bodies of drowning victims from India that get snagged on these headworks.\r\n\r\nThe best thing about Sialkot is the loving and beautiful people. The combination of Mughal, Persian, Pathan, Kashmiri ancestry has built a society that is not only beautiful to see but very industrious. When the British wanted bats for their Connelly park stadium (Jinnah stadium), the Sialkot people complied. When the British wanted surgical instruments for their soldiers in WW-2, Sialkot complied. When Germans ask for kinky leather accessories and pants, Sialkot people deliver in time. These Sialkotis are the jolliest, happiest and the enterprising people I have ever met.\r\n\r\nI love Sialkot because of my school and lovely class fellows… Seeing is believing. You must go there at least once!', 'The views expressed in the article are the author’s own and do not necessarily reflect our editorial stance.', 'alirehman@admin.ims', , '2021-01-19 14:21:24', 58);
