(2148, 'Dark Side Of Tech And Social Dilemma!', 'Technology', 'Waqas Shabbir', '7', 'Take a while to look around you, it feels like the world is going crazy, or we all have fallen under some kind of spell. You have to ask yourself, “Is this normal?”\r\n\r\nTwitter, Facebook, Gmail, Instagram, Snapchat, TikTok, YouTube, Google, LinkedIn all are familiar to these platforms. They are giving us so much fun and memories. They have reunited lost family members and friends; they have found organ donors, employment, and a variety of education. You felt addicted to these things and so much fascinated by the world they show you. Because of these platforms, there are meaningful systematic changes that are happening around the world. And of course, this is positive!\r\n\r\n“Nothing vast enters the life of mortals without a curse” (Sophocles).\r\n\r\nBut we are naive about the flip side of the coin.  They forcefully entered into your life and take away you, and you dance on their fingertips. Isn’t that sounding weird? These things are pretty different than your expectation. None of us deliberately pays effort to know these consequences.\r\n\r\nEven after facing the mountain of criticism Big Tech names are getting bigger and bigger day by day. The entire industries are under a new level of check but they don’t bother it. A new study sheds light and reveals information about the strong connection between social media use and mental health issues. Digital media firm Alphapro in Pakistan share a press release in 2018, the total number of active social media users were 35.00 million, hopelessly addicted to their electronic devices.  This is a worse fact that you can isolate yourself in a bubble, thanks to technology. “Any sufficiently advanced technology is indistinguishable from magic”. (Arthur C. Clarke)\r\n\r\nTheir business model is to keep people engage on the screen. Because of the tech industries overall we all have lost our way. Their motive is how to get as much of a person’s attention as they possibly can. How much time a person can spend on these platforms? How much a person can give us his life?\r\n\r\nWhen we will start thinking about how these companies work, it starts to make sense.  All the services on the internet we think of as free are not free; they are paid for by the advertisers. The question is why do advertisers pay those companies? Because they pay in exchange for showing their ads to us. We are the product for them; our attention is the product being sold to the advertisers.\r\n\r\nJaron Lanier author of “Ten Arguments for Deleting Your Social Media Right Now” says, “It’s the gradual, slight, imperceptible change in your behavior and perception that is the product.”\r\n\r\nThis is the new marketplace where they trade exclusively human future at scale. And these marketplaces produced trillions of dollars that made the internet companies the richest companies in the history of humanity. For example, you open your Facebook account and got so many notifications from those groups and pages even you did not remember when you liked or joined them. Did you ever think of where these notifications come from? Who send you? Surprisingly you get the videos and pictures about what you were thinking in your mind and suddenly you asked yourself how they know my searching, my plans, and thoughts. People should realize that everything they are doing online is being watched, is being tracked. Every single action is carefully monitored and recorded.  They have a lot of Data seriously!\r\n\r\nWhenever you created an account on any website they ask many questions and show their policy. You didn’t bother their laws and ignore all terms & conditions. And the funny thing is you will only see the “agree” or “I accept” option not “disagree” otherwise you can’t able to access their website. You by yourself gave them the right too much access to your data. And you can never take any legal action against them because you allow them by your hands.\r\n\r\nThey know when people are lonely; they know people are depressed, they know what you are doing late at night and the entire thing. What type of personality you have. They have more information about us. You can never imagine. In simple words all of the data that we are just pouring out all the day and night is being fed to the system almost have no human supervision that is specially designed to monitor you and me all the time, making better and better predictions about what we are going to do and who we are. The technology that connects us also controls us.\r\n\r\nThe whole world is looking for that moment when technology would overwhelm human strength and intelligence. It will replace our jobs and smarter than humans. This is overpowering human nature and checkmate on humanity.\r\n\r\nFake news is becoming more advanced and threatening the whole world. We have gone from the information age to the disinformation age.  We believe in all the stupid things that they show us. There is a lie everywhere. They keep the power and control everything. They control our minds. They know our secrets. Imagine a world where no one believes anything true. Everything is a conspiracy theory.\r\n\r\nSocial media is just not a tool waiting to be used but it has its own goals. It has its means of pursuing them by using your psychology against you. It is demanding things from you. It’s manipulating you. We have moved away from a tool-based technology environment to addiction and manipulating based technology environment. That is the biggest change. Social media is like a drug addiction that someone or an unknown person is continuously injecting you slowly and you are helpless.\r\n\r\nThe game is beyond this like Oh my god, the technology ruining the world and kids. It is just confusing because it’s a simultaneous utopia and dystopia. For example, you hit a button on your mobile phone and the map shows you where you are and in 10 minutes you reach the place where exactly you need to go.\r\n\r\nThis is magic I mean it’s amazing.\r\n\r\nI believe that people can change what social media look like and means. The way the technology is working is not a law of physics and is not set in stone. These are simple choices that human beings like I am making for myself. Accept or not but we should admit that bad outcomes of technology are coming directly. And human beings can change this technology and reform it. This technology is man-made. We built that weird and wacky place and it’s our responsibility to change it. We can demand that these products be designed humanely. We can demand not to be treated as an extractable resource. A miracle can happen to get out of it and that miracle is of course a collective will. We have to figure it out. It will take a long time because nobody recognizing the real problem.\r\n\r\nToday the biggest failure of these technology industries is leadership. Like people having an open and clear conversation about things, voicing their opinion on these things that are not perfect. So between us, someone can come and built up something new, try to reform not to destroy. End of the day these machines will not turn around until there is massive public pressure. For now, turn off notifications. It’s just wasting your time. Never accept video recommended by YouTube. Make a habit not to check your mobile phone after every one minute. Take a self-assessment if you don’t log in or use your mobile phone for one day what are your feelings?', 'The views expressed in the article are the author’s own and do not necessarily reflect our editorial stance.', 'alirehman@admin.ims', , '2021-01-19 16:48:47', 70),
(2149, 'No Substitute for Pakistan’s Economic Reality!', 'National', 'Muhammad Zohaib Javed', '41', 'Pakistan Tehreek-e-Insaf (PTI) continues to be blamed for the economic turmoil Pakistan finds itself in. The higher echelons of the opposition parties paint such a deplorable picture of the economy that one begins to envision Pakistan as being parallel to African countries like Zimbabwe and Nigeria. But is their contention valid? Do we need to alter the direction our economy is headed in?\r\n\r\nDiscussions of the current account have been a prevalent theme across the Pakistani media. The government and the opposition partake in a wordy tug of war on the two extremes of the debate. As I wrote earlier, “the sustainability of the current account deficit (CAD) is dependent upon the size, financing, and nature of the deficit. In the case where the deficit serves the purpose of investment, it will not be detrimental because the inflow of capital goods will balance it out in the long run. Such deficits will yield considerable future economic growth allowing the debt to be serviced.”\r\n\r\nHowever, in Pakistan’s case, the CAD burgeoned to a sizable amount at a time when the foreign exchange was plummeting. The scenario demanded a correction by pruning the commoners’ propensity to consume and the downturn in growth became inevitable. In the extant fiscal year, Pakistan posted a surplus of $1.1 billion in the first half against a $2.32 billion deficit in the same period last year. The commentators on both sides of the fence would differently interpret what this transition in status implies, but the eminent indicator in this regard is exports.\r\n\r\nThe exports are spiralling in Pakistan. A coherent national response in the wake of the pandemic and power relief packages by the incumbents are some of the many reasons which come to mind as a result of this scenario. The exports headed northwards by 4.9% to $12.1 billion in the period July-December as compared to $11.5 billion last year (before Covid-19). The month of December alone demonstrated a spike of 18.3% in export growth with the textile exports reaching record zenith of $1.4 billion. The long-term export trajectory will determine Pakistan’s economic fate. Nevertheless, this is unequivocally a direction which we would not desire to flip.\r\n\r\nPakistan managed to stage an admirable show on another external front, remittances. The expats remitted close to a quarter more back home in the first half of FY 2020-21. The monthly remittances remain above $2 billion while the balance stood at $14.2 billion in the period July-December. At this pace, Pakistan is likely to relish over $5 billion excess foreign exchange by the end of this fiscal year since the remittances were recorded at $23.12 billion in 2019-20.\r\n\r\nThere can be many reasons for this trigger in remittances. Reiterating my earlier stance on it, “the extraordinary leap can be primarily due to the tightening of informal money markets, which has augmented the inflow through formal banking channels…Pakistanis typically used to carry cash in their luggage physically. But due to flight reduction and sparse international travels, they would have been compelled to access official banking channels for money transfers. Also, remittances might have incremented on account of significant job losses in the Gulf region due to the Covid-related recession.”\r\n\r\nPakistan’s favourable external outlook meant that the rupee remained range-bound. However, unusual behaviour was observed in October and November when the rupee appreciated against the USD regularly for several days owing to ameliorated external flows of State Bank and USD’s depreciation due to Donald Trump’s ouster from the presidency. This can be deduced because the rupee went down against the GBP and Euro at the same time.\r\n\r\nThe economic team forecasted a 2.1% GDP growth in 2020-21, but this figure looks conservative at the halfway stage. Pakistan has witnessed a 7.4% expansion in the LSM output in the first five months of the fiscal year. In case the trend continues, double-digit growth in the LSM outputs would be on the cards. This alone will contribute at least 1% to economic growth. According to experts, agriculture and services are anticipated to grow at 2.5-3% each. This will drive growth of 1.5% and 0.5% even in the worst case. This means that the GDP is likely to grow at over 3% considering a positive growth in SMEs (non-LSM) as well. Hence, a revision in the growth estimates is predicted to occur in the forthcoming months.\r\n\r\n', 'The views expressed in the article are the author’s own and do not necessarily reflect our editorial stance.', 'alirehman@admin.ims', , '2021-01-20 16:55:44', 90);
INSERT INTO `blogs` (`BlogID`, `Title`, `Category`, `Author`, `AuthorID`, `Blog`, `Disclaimer`, `Admin`, `Pic`, `Date`, `Views`) VALUES
(2150, 'The curious case of China’s missing billionaires!', 'Global', 'Bahadur Ali Khan', '9', 'It appears that the dragon in East Asia is under fire once again from the global community. This time it is because of the missing billionaire, Jack Ma, largely hailed as the face of new China. So where is Ma? This is the question that has irked many political observers, both at home and abroad. Not falling prey to speculation and propaganda, China has a tainted track record against dissent and criticism. The international community was still pondering over reprimanding China for its treatment of the Uighur minority inhabiting the Xinjiang Uyghur Autonomous Region in Northwest China when this fresh tirade of weaponry was made available to them.\r\n\r\nMa was last seen at the Shanghai Bund Summit on October 24, 2020, where he criticised the Chinese regulators for creating a hostile atmosphere for entrepreneurship and innovation. Comparing the lending practices in China to “pawnshop mentality”, the billionaire remarked that “Chinese finance has no system.” Within a month, he had to face the brunt of the Communist Party of China, which not only pulled the plug on his financial giant Ant’s upcoming $37 billion IPO on November 3, 2020, but also increased the intensity of antitrust investigation against Ma’s Alibaba.\r\n\r\nIn this sequence of events, Ma also did not appear on the final episode of his business talent show “Africa’s Business Heroes.” All of this is reportedly being done at the behest of Xi Jinping himself. What reaffirms this claim is the continuous censorship of information related to Ma and Alibaba by the government’s propaganda department, forcing the media to publish only the official statements. It is difficult to decipher the facts since most of China’s most prominent newspapers are state-run. Hence, we have to rely solely on what little news comes out of our neighbor, or through western media outlets.\r\n\r\nThis is not the first time billionaires have gone missing or mysteriously returned in government custody accepting charges of corruption, embezzlement and so on. Some were even hanged in sham trials. Ever since Beijing passed a law in 2013 allowing arbitrary and secret detentions, many Chinese moguls have mysteriously dropped off the radar. It can be noted as a part of a larger pattern on what happens with dissenters and critics of the Chinese Communist Party (CCP). Jennifer Wang in her article for Forbes lists down the prominent personalities that had encounters with the party similar to those of Ma.\r\n\r\nThe Chinese Warren Buffet, the founder and chairman of Fosun International, Guo Guangchang and the Fashion billionaire, Zhou Changjian disappeared from public life in 2015 and 2016 respectively with no explanation. Similarly, Wang points out that Ren Zhiquian, a Chinese real estate billionaire, was expelled from the CCP in 2020. His assets were seized, and Ren was sentenced to 18 years. What was his crime? Ren criticised the party over its handling of the Covid-19 pandemic, and at one point referred to Xi Jinping as a “clown.” Lai Xiaomin, the former chairman of China Huarong Asset Management, was sentenced to death on charges of bribery and corruption. The list is long and cumbersome.\r\n\r\nThe message of the party for the business elite is loud and clear. The party is everything. Either, you show loyalty to the party, or be erased from existence. ‘‘There is no so-called [Ma] era,’’ read a recent headline in the CCP mouthpiece People’s Daily, ‘‘but only an era that has [Ma] in it.” The state paper said in 2019 that, “If you disregard your food and make use of the policy advantages given by the state to do business that is not conducive to economic development and not beneficial to the people\'s lives, you will only end up reaping the consequences.” Looking at current events, it is clear that Alibaba’s founder should have paid heed to this warning.\r\n\r\nIn totalitarian regimes, you can be the party’s favourite, but it only takes a fraction of a second to fall out of favor. It appears that the CCP is all set to tighten the screws on the business elite, more so on dissenting voices. Why is the dragon in East Asia so insecure? In the words of Julian Assange, “What does censorship reveal? It reveals fear”. Fear from what? Is the exercise of free-will and thought so dangerous for the authoritarian party of China, that they go to extraordinary lengths for an all-out attack on dissent?\r\n\r\nWhether it is the Chinese treatment of their minorities in largest human concentration camps, or their complete silence regarding an investigation into the spread of Covid-19 last year, one thing is evident; the CCP fears criticism and imposes a doctored image of itself. Just look at the story of Ma. From being one of the richest people in China, an inspiration for youth across the nation, to being labelled as an “evil capitalist” and a “blood sucking vampire” to be despised. This is a daunting case for many, especially those who want to adapt the Chinese model at home.\r\n\r\n', 'The views expressed in the article are the author’s own and do not necessarily reflect our editorial stance.', 'alirehman@admin.ims', , '2021-01-20 16:58:38', 104);
INSERT INTO `blogs` (`BlogID`, `Title`, `Category`, `Author`, `AuthorID`, `Blog`, `Disclaimer`, `Admin`, `Pic`, `Date`, `Views`) VALUES
(2151, 'Biden should not scapegoat Russia!', 'Global', 'Muhammad Zohaib Javed', '41', 'The Biden Administration is re-evaluating practically every element of foreign policy that it inherited from former President Donald Trump, but nowhere could this potentially impact Pakistani interests more than in Afghanistan. National Security Council spokeswoman Emily Horne announced on Friday that the United States (US) will “assess whether the Taliban was living up to its commitments to cut ties with terrorist groups, to reduce violence in Afghanistan, and to engage in meaningful negotiations with the Afghan government and other stakeholders” as part of the February 2020 deal that the group agreed to with the Trump Administration. Interestingly, this also comes against the backdrop of the Biden team declaring that it’ll investigate last summer’s Russian bounty scandal.\r\n\r\nTaken together, these are worrying signs that the Biden Administration might be preparing to scapegoat Russia if it reverses former President Trump’s Afghan drawdown for unrelated reasons such as those connected more to domestic political considerations than legitimate security ones. The political Russophobes who comprise the Biden team are well known for pushing baseless conspiracy theories about Russia, especially the infamous but ultimately debunked one that former President Trump was secretly Russian President Putin’s puppet all along. It’s therefore politically convenient for them to scapegoat Russia as the “plausible pretext” for symbolically halting or potentially even reversing former President Trump’s military drawdown from Afghanistan.\r\n\r\nIt’s important to point out that there were actually three bounty scandals that were talked about over the past half year. The most well-known is the Russian one, but Iranian and even Chinese versions were also later reported upon by the Western Mainstream Media. The decision to go ahead with investigating only the original Russian narrative suggests that the Biden Administration is signalling to the other two that it doesn’t take the previous allegations made against them seriously. This could reinforce the goodwill that his team is trying to cultivate with both of them in pursuit of differing degrees of detente. No such intention exists on their side when it comes to Russia, however, which is why they might scapegoat it for changing course in Afghanistan.\r\n\r\nThey’d be well advised not to do that, though, since the long-term strategic risks of that potential decision far outweigh the hoped-for short-term domestic political benefits. Pakistani Foreign Minister Shah Mehmood Qureshi earlier urged the Biden Administration to stick to the policy that they inherited, which they might still seriously be considering since they reportedly decided to retain Special Envoy to Afghanistan Zalmay Khalilzad at least for now. This might speak to the tacit desire of the Biden Administration to proceed with the peace process without any significant disruption, in which case they could be playing the Russian card on the Afghan file for domestic purposes related to making it seem like they aren’t blindly going along with Trump’s policy.\r\n\r\nAnother educated conjecture is that the Biden Administration wants to signal to those dissident military leaders who were suspicious of Trump’s drawdown plan in the first place that it’s listening to their concerns and plans to discuss with them the pros and cons of continuing that course of action. That would explain why they’re telling the public that they’re investigating the Russian bounty scandal and assessing whether the Taliban was living up to its commitments. These two complementary announcements could provide the Biden Administration with the excuse needed to stop the drawdown or even potentially reverse it in a low-level but nevertheless symbolic way, though most likely far from repeating the folly of the failed Obama-era “surge”.\r\n\r\nIn the event that the Biden Administration does indeed halt or even partially reverse former President Trump’s Afghan drawdown, they shouldn’t mislead everyone about the reasons behind this decision by trying to scapegoat Russia for it after their bounty investigation finally concludes. They could simply say, for example, that they felt that their predecessor’s decision was premature and possibly even irresponsible from a security perspective, citing high-level military officials to corroborate that assessment instead of blaming it on Russia like the political Russophobes on his team might be preparing to do. ', 'The views expressed in the article are the author’s own and do not necessarily reflect our editorial stance.', 'faizaliaqat@admin', , '2021-01-22 17:01:17', 84);
INSERT INTO `blogs` (`BlogID`, `Title`, `Category`, `Author`, `AuthorID`, `Blog`, `Disclaimer`, `Admin`, `Pic`, `Date`, `Views`) VALUES
(2153, 'Roguish Trends In Media And International Hypocrisy!', 'Media Logs', 'Amna Noreen', '6', 'A wicked trend that is booming across the social media and in journalism, which I will call “Hoax exploration”. The meaning behind hoax exploration is bringing information without research. This disease has stabbed many journalists and channels across the globe. This trend has been the path to hide the veracities and brutal happenings behind the curtains of fake news and slipping the attention from the truths.\r\n\r\nHighlighting the duties of journalism is very important, journalism is neutral and needs to convey the right and honest experiences to the society. But unfortunately, the bitter truth is we are being fed with Hollywood and Bollywood whereas the happenings in the nearby Muslim countries are not broadcasted where a “Programmed Massacre” is happening on daily basis. Sorry to say but the double-faced international media, which quotes the so-called ISIS and other Extremist group as Muslim extremist and on the other hand they shut down every broadcast that discloses their massacre of innocents, women and civilians in countries as Afghanistan, Iraq, Iran, Palestine and Kashmir.\r\n\r\nLet’s take an example to make it clearer, you have oil and natural resources in your house, person living in the other town comes and hits you, snatches all your resources and when the media ask him why he did that he replies simply, Oh! The terrorists settled here, and I washed them out. So, this is the example of media that conveys what its being fed. Millions of Deaths in Muslim countries through missile, drones and deploying troops aren’t broadcasted due to fear of sanctions or international boycott, whereas international rules are broken by god fathers for which they aren’t interrogated.\r\n\r\nMany may criticize me for writing the bitter truth, but I respect every opinion. The media needs to play a justified role in bringing the real news with proper research rather than displaying what is being fed by world leaders forcefully.\r\n\r\nQuoting Jericho “Journalism is a mission not a business”.', 'The views expressed in the article are the author’s own and do not necessarily reflect our editorial stance.', 'faizaliaqat@admin', , '2021-01-23 11:51:36', 100);
INSERT INTO `blogs` (`BlogID`, `Title`, `Category`, `Author`, `AuthorID`, `Blog`, `Disclaimer`, `Admin`, `Pic`, `Date`, `Views`) VALUES
(2154, 'Kashmir: A Walk In Paradise!', 'Life Style', 'Waqas Shabbir', '7', 'Pakistan has been rewarded with countless blessings, whereas Kashmir has been one of the most controversial yet beautiful places in the world. One cannot justify the beauty of this place until they experience the bliss with their own eyes, so I am going to narrate the story of my most beautiful voyage to the worldly paradise called Kashmir.\r\n\r\nHaving my excitement already at the zenith from the erstwhile tour of the Neelam valley, I decided to bless myself with the breeze of Jhelum Valley in the Azad Kashmir Pakistan this time. My story starts from Muzaffarabad where after just mere hours of travelling from the Muzaffarabad towards my destination, I took a break to taste the famous Kashmiri “Kushtaba” dish which had marinated meat balls into the rice enriching its mild spices with my taste buds. To even take a shot at describing the toothsome taste of this unique dish is injustice to it.\r\nFeasting on one of the most delightful food you can get in Kashmir, I resumed my unaccomplished journey around noon under the warm sun shying behind the clouds. Not just the sky, not only the food, not only the blistering journey but the people of Kashmir were so amicable that when I decided to buy some fruit to keep my appetite conscious of the beauty I was having around, the Kashmiri vendor did not charge even a single penny and gifted them as a gesture of brotherhood and love towards us.\r\nListening to the snarling waterfall of Chinari sky-rocketed my impatience and made me want to just instantly transmit to my destination but they say real fun lies in the journey, which exactly happened to me when a young boy gently asked for a lift saying, “Bhai, mujhay Hadianwala jana hai. Kya aap mujhay chor dein gay?” Now, I had some unexpected and frivolous company which just cemented the saying, “the more, the merrier”. His name was Mubeen and he was a student of intermediate from Hadianwala. We shared few laughs and our experiences when he told me that he is a Muhajir and lives at Muhajir camp. He showed me his house and offered tea and talked about the survival of his family in the valley, which honestly was way too heart-wrenching despite being in the world’s most beautiful place. He was so gracious that he decided to accompany me till my destination and I couldn’t even thought about saying no to such a warm person.\r\n\r\nWe both reached a bridge skirted by monstrous, lush and cold mountains. It’s a view I can never forget and explain in words. My eyes were smiling and heart was crying to have this breath-taking opportunity to be standing where peace blew from North to the beauty of South. Mubeen, pointed towards the right introducing me with my heavenly desired place.\r\nI felt at the moment that it was the thing I was born to witness. The waterfall producing its own symphony like Mozart shed tiny drops of water on my face. The single touch of each cold drop scorched a fire of travelling for me. It made me want to explore the whole world, watch every nook and crook like this and get laid down in these soothing and lush sceneries. I, myself, along with locals enjoyed the madness of this waterfall and thanked Allah for such a beautiful gift to the mankind.\r\nAmir Khusrou said once while visiting Kashmir\r\nFarsi Couplet,\r\n“Agar firdaus bar roo-e zameenast,\r\nHameenast-o hameenast-o hameenast.”\r\nIt means, “If there is a paradise on earth, It is this, it is this, it is this”.\r\nEven the apple I was eating, sitting on the rock while being lost in the waterfall, tasted like it has freshly come from the paradise. Locals were selling pakoras, burgers and other food items around us but I had other plans which included another stop to the Chakothi which was just few kilometers away from this serenity. But, my destination ended when few police officials did not let us advance owing to security measures.\r\n\r\nLooking at this heaven left a mixture of euphoric and melancholic feelings in my heart. Despite, being such a grand beautiful valley with kindhearted people, it has been part of a never-ending controversy for so many decades. I hope Kashmir regains its status and shine brighter than ever before this world.\r\n\r\n ', 'The views expressed in the article are the author’s own and do not necessarily reflect our editorial stance.', 'alirehman@admin.ims', , '2021-01-23 11:54:25', 251);
INSERT INTO `blogs` (`BlogID`, `Title`, `Category`, `Author`, `AuthorID`, `Blog`, `Disclaimer`, `Admin`, `Pic`, `Date`, `Views`) VALUES
(2155, 'Who Should Be Responsible For Reducing Global Warming?', 'Health', 'Muhammad Ali Falak', '3', 'Many people admit their role in damaging our mother nature. Individuals are more likely to be affected and thus sensitized by environmental changes than governments. In Pakistan, for example, dense smog was observed in 2016 which hindered day to day activities of individuals. The government showed concern; however, no significant action was taken against it. The higher authorities stressed upon creating awareness about it but its implementation rests in the hands of public.\r\n\r\nThe global warming is fraught with disastrous consequences for humans. In view of its tremendous importance research has been conducted worldwide to find out how to control and reverse this phenomenon. The studies have been reviewed in the form of a book, the bestseller entitled “Drawdown : The Most Comprehensive Plan Ever Proposed to Reverse Global Warming “. The data sorted out, has been analyzed and used to solve the global warming problems through formulation of 80 models. The book largely emphasizes upon solutions based on an individual’s activities. It thus depends on how individuals at household level react and help in averting global warming. If the public reduces the consumption of non-renewable sources then large scale producers will also be discouraged from exploiting finite sources of energy. Therefore, use of environment friendly products should be encouraged at individual level, for instance, use of paper bags instead of plastic bags in grocery stores. This would also discourage factories from producing goods made of plastic that are detrimental to the environment, thus highlighting the importance of collective reactive power.\r\n\r\nDigital technology has entered a number of areas of commercial significance . Emergence of online marketing at international level is one of them. As a result of such an online deal China annually dispatches 15 million mail-packages to Finland. (Helsingin Sanomat, 3 March 2019). The dispatch of such a huge cargo through different transport means across long international distances serves as a source of environmental pollution through emission of greenhouse gases and thus criminalizes as a culprit in global warming. Such environmental hazards can be obviated through development of innovative national policies, designed to inculcate predilection among the populace for consumption of indigenous products manufactured through environment-friendly processes.\r\n\r\nModern innovative practices have been introduced in agriculture, particularly towards the end of the last century. This has led to massive agricultural production. To offset adverse effects of global warming, farming techniques based on environment friendly methods, ought to be introduced. These new methods directly or indirectly reduced the amount of greenhouse gases released in the atmosphere. Researchers in Stanford University led studies on this aspect and recorded their findings in a publication. Steven Davis, co-author of the paper, as a result of the investigation, recommended investment in agriculture as a cheap means of avoiding emission of greenhouse gases. High demand for scarce resources such as water and energy has impelled farmers to look for and apply more innovative farming practices such as dry farming, using drip irrigation and planting cover crops. If farmers show inclination towards learning advanced scientific techniques to grow crops and raise livestock then the government may also be moved to set up institutions and model farms for training them on modern lines. However, in Pakistan reluctance to these latest methods has been observed as people complain that this has led to reduced labor requirement and high unemployment. Chaudhary Abdul Hameed, Director, Faisalabad Agriculture (Extension), opined that the earnings of a farmer, made in his profession, also depend upon how much favorably inclined he is towards new developments in agriculture. But it is now dire need of the hour to adopt modern methods for food production and meet the increased needs of food for rapidly growing population.\r\n\r\nExcessive use of fossil fuels in agriculture and the resultant share it had towards greenhouse gas emission necessitated search for its replacement. Installation of solar panels and wind turbines on farms as a source of renew able energy was engineered as a substitute. Technology for production of renewable energy being at a nascent stage of development it required improvement in its efficient use. Other steps deemed desirable to reduce environmental pollution include less use of fertilizers and pesticides derived from petroleum products. Besides farming practices, storage and movement of crops may also preferably be based on renewable energy.\r\n\r\nIn consequence it could be concluded that quality of natural environment should be maintained through efforts both at grass root level and through official policies. The role of government and higher authorities cannot be negated but it is the attitude of public at large that brings about a significant change.', 'The views expressed in the article are the author’s own and do not necessarily reflect our editorial stance.', 'alirehman@admin.ims', , '2021-01-25 12:00:55', 59);
INSERT INTO `blogs` (`BlogID`, `Title`, `Category`, `Author`, `AuthorID`, `Blog`, `Disclaimer`, `Admin`, `Pic`, `Date`, `Views`) VALUES
(2156, 'Pakistan’s Television Industry Needs To Up Its Game', 'Media Logs', 'Mahnoor Kashif', '2', 'Our television industry believed it was safe. Can you see it going down in flames? Do you feel that they need to get the show on the ground? In the last 10 to 15 years this television industry has shown exponential growth. Apparently, they have lost the touch. It seems like they are down for the count. Are they out of prolific ideas? Have they forgotten how to instill spice in the TV shows? This drama industry has been a query for ages.\r\n\r\nThe Pakistani cinema industry is another chapter. TV actors performing in the cinema industry is the first flaw. We don’t pay to see the same faces on the big screen. It’s not about being a nit-picker but let’s call spade a spade, cinema needs someone with the degree and practice of acting. Acting is the art of communicating and instilling positivity into the people sitting on the other side of the screen. It’s not just about being humorous, it’s beyond that. People should leave the cinema saying it was a good show, yeah, I have learned something useful, yes, the ideas they presented were amazing. In short, they buy what you tried to present. People don’t want to misspend on something which is already on the TV.\r\n\r\nHeard about the power of media? This medium (television) is a mean to bring positive monumental amendments in human lives. At some point it did. It has the power to portray a positive aspect into a negative one and a negative aspect into a positive one, creating prodigious influence with sugar-coating every facet of the world. This medium is not utilized to generate something valuable. Let’s not beat around the bush! Its main purpose is to disseminate recognition, understanding, and conscience about the issues of the world in a positive way.\r\n\r\nLet’s shed light on the dramas that are just bog-standard. Almost every drama has the same storyline with the same actors. Television has raised writing to a new low level. Dramas that don’t end up changing or bringing a new perspective on life are dreary thus not living up to the hype. Most accentuated storyline circles around affairs, breakups, marriages, divorces, and family politics. According to our media, we are left with only these issues in our lives. These are the issues, but there are other problems that need a hearing, which seems a pie in the sky. Why writers and producers don’t wrap their heads around history, child abuse, poverty, lack of education, gender discrimination, climate change and unemployment.\r\n\r\nNow, most of you would say that these issues are discussed on the news channel. Ever heard about the POWER OF AN ACTOR. They empower, inspire and motivate the salt of the earth. Now, these are very sensitive issues (climate change, child abuse, etc.) and need to be addressed positively in a way that offers solutions to the problems and changes the perspective of people towards them.\r\n\r\nHere’s a food for thought! Sometimes your friends, family or relatives talk about their problems all the time with you which makes you upset. They just suck the juice of life out of you by crying over spilled milk. You love them but you just don’t want to be around someone who broods and whine all the time. It’s a rule of thumb; happiness allures happiness and sadness allures sadness.\r\n\r\nSo, why this media is spending millions on producing content that is not worth a hill of beans, bringing the worst out of people, making them more upset than they already are, leaving them in agony, depression, and tears. The show should leave you with something that makes you question your life, motivates you to do something and inspires you to improve yourself and society.\r\n\r\nThe race to produce quantity has utterly ruined quality. Content is going out of the frying pan into the fire day by day. Humans are three-dimensional, they are about positivity, negativity and reality. Presenting your content in a way that represents reality, asking people to take life with a grain of salt, showing humor as the solution to overcome difficulties is an art. Life is not a bowl of cherries, nobody said that it’s going to be easy and to make people understand that how to deal positively with life takes great content.\r\nOur TV industry is not short of talent. We have beauty with brains. Question is that were they successful in making themselves your role model? Were they able to build an audience who trusts them blindly and from whom they get inspired?\r\n\r\nActors are full of beans but the strategy to cut corners is resulting in a massive downfall of dramas. It seems actors do everything at the drop of hat. Being pretty or having good looks is not enough to get admiration and respect. You act and we know you have put up a fake show. But when you work hard on your acting skills, we buy it. A good actor can bring the best out of the worst script but a bad actor sabotages everything. Cutting the mustard is not sufficient if people are not buying what you are trying to sell. It takes hard work and ethics.\r\nInjecting sensible, reasonable and appropriate content by remaining in the framework is the meat and potatoes of dramas. The following trend is salient to keep people engaged with the world. New topics are needed to stir the conscience.\r\n\r\nMost of us watch English TV series. They are designed for every age and gender. It’s not about comparing them to our Pakistani Dramas. It would be comparing apples to oranges. Our big brains are stuck to deliver only marital issues and showing violence. The reason of mentioning English TV series is to get ideas from them and to display them by remaining with the rules of the framework.\r\n\r\nOne of the biggest blockbuster TV shows BREAKING BAD delivers a message for the people riding a gravy train that they will end up with nothing. So, the series revolves around hurdles of life, how to overcome those hurdles, the peril of shortcuts and a message that it would cost an arm and a leg to take shortcuts in life. There are billions of other English TV series that just leave you with amazement. You binge-watch these series. WHY? They are producing what you want, they are showing you the realities in a positive way, they are offering solutions to the problems and above all, they are injecting positivity in your minds. Again, it’s not to promote their culture. There is nothing bigger than saving the culture. The aim is to take their positive points, add those to your content and present it within a rational framework.\r\n\r\nWhy are we not adopting this approach? Is it the budget? Is it the better production facilities and resources? In the end, audience goes with the trend. No one likes a museum piece. Of course, we were producing dramas for eternity like dhoop kinaray, alpha bravo charlie, tanhaiyan, teen bata teen and many more. They were immensely surpassing. That era of Pakistani drama history reminisces as the golden era.\r\n\r\nThis TV industry is so infectious and we are not endeavoring to create which is rare. Marriages, affairs, breakups, family politics, violence against women is a recurring in every drama. Bringing up themes that are 90% delusional. Portraying characters in a negative way. There is already too much hatred in the world. Why enhance abhorrence which is already there? Are we out of intriguing and viable ideas that brings out the positive energy?\r\n\r\nIt’s always darkest before the dawn. This industry is retrievable and all they need is to think outside the box. Actors are in a dire need of incessant hard work. Pakistani TV industry can be the backbone of our amelioration as a society. A unique style of presentation and a realistic theme is needed for showcasing the talent in Pakistan. People are getting acting degrees from abroad; we just need to polish them a bit and instill these exuberant and fresh talents in our industry and last but not least content should deliver reverence, gratitude, and compassion that will lead to a positive environment.\r\n', 'The views expressed in the article are the author’s own and do not necessarily reflect our editorial stance.', 'faizaliaqat@admin', , '2021-01-26 21:05:16', 199);
INSERT INTO `blogs` (`BlogID`, `Title`, `Category`, `Author`, `AuthorID`, `Blog`, `Disclaimer`, `Admin`, `Pic`, `Date`, `Views`) VALUES
(2157, 'Is PDM\'s main stance changing?', 'National', 'Sulman Ali', '5', 'The joint opposition under the banner of the Pakistan Democracy Movement (PDM) is in full swing, to remove the ‘selected’ government of Imran Khan. On Tuesday, the PDM carried out a protest in front of the Election Commission of Pakistan (ECP), ostensibly unveiling the funding sources of the ruling Pakistan Tehrik-e-Insaf (PTI) government. Earlier this month, at a rally in Bahawalpur, its leaders vowed that there is ‘no stepping back’ and that once the PDM lawmakers resign it will be the curtail call for the government.\r\n\r\nThe PDM launched its movement from Gujranwala, where former prime minister Nawaz Sharif’s address shocked many. During his video link speech, Sharif directly blamed the military for toppling his government. “You can seize my properties, can declare me traitor, if you want, but Nawaz Sharif will continue to talk to his people,” said the former premier.\r\n\r\nFurthermore, the PML-N Vice President Maryam Nawaz Sharif also criticized the establishment. “The army establishment should not side one political party and should be very careful,” she said during a speech.\r\nThe opposition has been blaming military for bringing Khan to the office of PM. The opposition believes that the military ‘selected’ Khan through massive rigging in 2018 elections. PDM has vowed that Khan’s government will end soon. Even, the PML-N has claimed that the current government will end in January 2021.\r\n\r\n “Imran Khan’s government would be sent packing following Pakistan Democratic Movement’s protest campaign,” Maryam Nawaz said.\r\n\r\nMeanwhile, Prime Minister Imran Khan has slammed the opposition for maligning military and COAS Bajwa. After Nawaz’s speech in Gujranwala, the premier addressed a ceremony, saying, “PML-N leader was using inappropriate \"language\" against the army and ISI chiefs at a time when Pakistani soldiers were constantly sacrificing their lives for the nation.\r\n\r\nThe PDM, especially the PML-N and the JUI-F, has been directly targeting army after the 2018 general elections. On one hand, the PML-N and its top leadership is criticizing army for snatching the electoral vote.\r\nAccording to them, the establishment took the vote of public and established the government for their choice. Since 2018, the opposition is all ready to go head-to-head with the military establishment. On multiple occasions, the opposition expressed such sentiments, that a revolution seemed around the corner.\r\n\r\nBut experts ask why that ‘revolution’ is postponed or delayed every time? Many feel it is because of a weak stance by the opposition. There have always been reports and rumors of PMLN’s ‘deal’ with the establishment. The current example is Nawaz Sharif’s departure to London after remaining in hospital for days. The former premier not only got bail, but was also allowed to fly abroad.\r\n\r\nFurthermore, the second major party in PDM is PPP and its co-chairman Bilawal Bhutto Zardari has said that he was shocked, when Nawaz Sharif took the name of COAS Bajwa directly. “It was a shock for me because, typically, we don\'t talk like this at rallies. But Nawaz heads his own party and I can\'t control what he says, just like he can\'t control what I say,\" Bilawal said. The PPP’s presence at the PDM rallies has gradually declined in recent weeks.\r\nLater on, Maryam Nawaz has also said that PML-N is ready to hold talks with establishment, \"provided that the PTI government is dismantled” adding that “the army is my institution.” Although it appears to be a normal statement, but if you take the recent statements and attitude of PML-N in recent past, then it would seem to be a major shift.\r\n\r\nEarlier, the PML-N’s top leadership has repeatedly targeted military for its role in politics, and now it is ready to talk, if Khan’s government ends. Is the opposition’s main stance changing? Or is it ready to ‘compromise’?\r\n\r\nMany experts feel that Khan’s government will not go anywhere because he and army are on the ‘same page’. The strict anti-army stance has further impacted the political vote and reputation of PML-N. Even some old PML-N leaders have slammed Nawaz and some left the party over Nawaz’s statement against Bajwa.\r\nMany say that Sharif cannot just ask people to come on roads for an anti-army revolution, when he himself is sitting in London. For many experts it is a long process, which needs a huge commitment by political leaders, who should not sign a ‘deal’ with establishment for own convenience and then criticize it.', 'The views expressed in the article are the author’s own and do not necessarily reflect our editorial stance.', 'alirehman@admin.ims', , '2021-01-27 21:10:58', 153);
INSERT INTO `blogs` (`BlogID`, `Title`, `Category`, `Author`, `AuthorID`, `Blog`, `Disclaimer`, `Admin`, `Pic`, `Date`, `Views`) VALUES
(2188, 'Zindagi Gulzar Hai has the Power to Transform You!', 'View Point', 'Amna Noreen', '6', 'Zindagi Gulzar Hai is a wonderful and amazingly written social romantic Urdu novel by the exceptionally talented Umera Ahmed.\r\n\r\nThe novel has the privilege of being the first book of the writer which she wrote just to improve her writing skills without ever knowing that a writer lives within her. Umera Ahmed has wonderfully sketched the social difference between the upper class and lower class, gender difference and turning diversity into opportunity in the novel.\r\n\r\nThe novel is not merely bounded within a sole moral idea, but is based on various themes. It focuses on faith in Allah and putting efforts when antecedents are against you. It’s a wake-up call to our society that relationships often require comprise and sacrifice. Without these, neither life is a blessing nor does it bring joy.\r\n\r\nZindagi Gulzar Hai (life is a rose garden) compels the readers to think how blessed they are, as they often don’t realise this. The novel explains the hardships of a young woman who has not much in her life, but a good character and intelligence. Ahmed has shown the readers what treasure one can be if they do have moral values and quality of goodness.\r\n\r\nZindagi Gulzar Hai revolves around the life of Kashaf Murtaza and Zaroon Junaid who are diametric to each other in every sense. Kashaf Murtaza is an average looking girl from a middle-class family and has a lot of responsibilities. She has an extremely unsatisfied life due to the financial constraints which affects her self-esteem badly. She is disturbed about everything that happens to her, but refuses to give up.\r\n\r\nOn the other hand, Zaroon Junaid belongs to an elite class family. He has every great thing in life and an unshakable self-confidence. The only thing missing in Zaroon’s life is a close knit family that has enough time for each other.\r\n\r\nThey both meet in college. They literally hate each other and debate over petty things. The novel whirls around Murtaza’s miseries and the hard work she does to reach to a designation as big as a civil superior police officer.\r\n\r\nOne of the most unexpected things is the marriage of Junaid and Murtaza. I adore this novel for its uniqueness and lovely method of engaging the audience.\r\n\r\nThe hatred between Murtaza and Junaid ends up in marriage.', 'The views expressed in the article are the author’s own and do not necessarily reflect our editorial stance.', 'alirehman@admin.ims', , '2021-01-03 23:12:19', 272),
(2189, 'A Review of Jannat kay Pattay!', 'View Point', 'Mahnoor Kashif', '2', '\"The book with million secrets and mysteries that will not go as you guessed, because keeping secrets is an art not everybody knows!\"\r\n\r\nFrom an acclaimed Pakistani novelist Nemrah Ahmed comes a masterpiece, mixed with a thriller, suspense, romance, mystery, and spirituality. It’s hard to say if this book can lie into one genre as it equally takes its readers on an enigmas journey mixed with love and constant doses of shocks. This novel was originally published in Shua digest from May 2012 to May 2013.\r\n\r\nPLOT:\r\n\r\nHaya Suleiman is an LLB-Honours student and she is reading sharia law (Islamic law). Her excitement starts when she receives an email stating she has been accepted for the European Union’s scholarship in which she will study at Sabanji university of Turkey for 6months (1-semester). The main attraction of Turkey’s visit is Cihan Sikandar (Jahan Sikander in Urdu). Cihan is her aunt’s only son to whom she was engaged when they were 8 years old. With ongoing years, Haya felt an unspoken attraction towards Cihan that she could never let go. Now, with this tour, she has a lifetime chance to solve her life’s biggest question – Does Cihan desire this relationship like her or will he unbound the tie their families made years back?\r\nThe story takes a turn when Haya receives anonymous white roses at all stages of her tour. She is left astounded upon receiving a bouquet of white roses at her doorstep with a card dated a day before she got the mail, that says “welcome to Sabanji”. Who knows her life’s future ahead of time and way before she is informed officially? Will she find her answers and get to the spy? Will she be able to solve her mysteries? What turns will Haya and Cihan’s love story take? These are just a few questions that will rise in your mind while reading this novel. A lot more is waiting for the readers in every other chapter.\r\nThis book addresses not one but several issues of Pakistani cultural society. The story has a spiritual aspect, Haya’s journey from being a modern glamorous girl to a hijabi, practicing Muslim. The hurdles she faces all along her journey to become a simple practicing Muslim and changing her avatar. One main side of the story is her fight against the norms of the society. Another side is Cihan’s story and his journey. He is born and raised in Turkey and has always faced negligence from his Pakistani cultural uncles (one of which is Haya’a father) due to his father’s actions who was expelled from the Pakistani army and now has taken a refuge from the Turkish government. Cihan’s struggling childhood and his complexities have made him a tough guy. He wants to white-wash the dirt on his family’s name and regain his dignity. I could write a lot about Cihan’s story but that will give away the whole story. Why don’t you guys read the book and get to know the mystery yourselves?\r\n\r\nJKP is full of twits that will leave readers flabbergasted. Every chapter brings a new edge to the story. Haya receives a mystery box that has her life’s biggest secret, the one that will answer all her questions, but for those answers, she has to solve a series of riddles in order to open the mystery box. The book takes readers on a tour through the old and new and undiscovered cities of Turkey. From Bosphorus bridge to streets of Istanbul, from the caves of Cappadocia to palaces of Buyukada, from scenic views of Islamabad streets to the dark cages and prison of India, JKP will take you on a roller coaster ride where most of your guesses will go wrong and answers will amaze you at the end.\r\n\r\nLESSON:\r\n\r\nAs said above, Jannat kay pattay addresses several issues of Asian/ Pakistani society that is bound by cultural complexities. The development of Pakistani society has made several matters a norm which has to be changed. We address issues like gender segregation in weddings and partialities of our society as a matter of Islam, but those are actually, a matter of culture. It’s time that people should learn to differentiate between culture and religion. But as talked in every era, we still live in a society which believes taking hijab from cousins and in weddings is extra and is considered as feigning religion. But in reality, that is what Islam really is.', 'The views expressed in the article are the author’s own and do not necessarily reflect our editorial stance.', 'faizaliaqat@admin', , '2021-01-28 00:00:30', 304);
INSERT INTO `blogs` (`BlogID`, `Title`, `Category`, `Author`, `AuthorID`, `Blog`, `Disclaimer`, `Admin`, `Pic`, `Date`, `Views`) VALUES
(2190, 'A massive opportunity in sight!', 'National', 'Bahadur Ali Khan', '9', 'The recent housing finance scheme being offered by the State Bank of Pakistan may be a once in a lifetime chance for a common citizen to climb the housing ladder.\r\n\r\nThe intent of this scheme was to give a much-needed stimulus to the construction sector and to increase home ownership rates (part of broader plan to increase the middle class). This scheme certainly builds up to be a “win-win” for the masses, the government, and the business community.\r\n\r\nTo quote Dr Hafeez Pasha (a renowned economist) “This is the first time we have negative real interest rates since the 1950s”. Take into perspective that you are literally being paid to borrow money. The State Bank has further subsidized the cost of borrowing for mortgages so heavily that it seems untrue.\r\n\r\nTaking my base case, people who qualify for tier 1 - a property assessed can be worth a maximum of 3.5 million PKR and must have an area of less than and equal to 125 square yards. The maximum loan amount that could be attained after the banks credit analysis of applicant is 2.8 million PKR.\r\n\r\nNow I will list down all the benefits of this scheme. The interest rate being offered on this loan is 5 percent, the discount rate currently stands at 7 percent and the current inflation rate is around 9 percent. The borrower enjoys a positive yield of 400 basis point on the principal he/she borrowed, hence the more the amount borrowed, the better. This is a fixed rate loan with a 5 percent markup for the first 5 years and 7 percent for the next five years. This is the first time in the history of Pakistan a fixed rate loan of such a lengthy tenure is being offered and that too, at a markup lower than the discount rate. \r\n\r\nThere is speculation in the market that the discount rate might be revised upwards to 9.25 percent by mid-year. The construction cost attributes most to the price of the housing unit in this price bracket. The construction cost of housing is not going to get cheaper any time sooner. The supply chain disruption, unparalleled demand by China, a housing boom globally in first world nations doesn’t add up well for housing.\r\n\r\nMost commodities used for construction have gone significantly up in value most notably copper, iron, steel, and timber. Add on to that the cost of freight which has more than doubled recently, importing these raw materials now comes at a greater cost.\r\n\r\nThe demand for housing in big cities outstrips the supply and you can bet that price appreciation of this asset would be comfortably above the rate of inflation. Needless to say, this is the greatest opportunity a common man could capitalize on right now.', 'The views expressed in the article are the author’s own and do not necessarily reflect our editorial stance.', 'faizaliaqat@admin', , '2021-01-29 00:20:01', 82);
INSERT INTO `blogs` (`BlogID`, `Title`, `Category`, `Author`, `AuthorID`, `Blog`, `Disclaimer`, `Admin`, `Pic`, `Date`, `Views`) VALUES
(2191, 'Disrupting Pakistan’s Education System with Innovation!', 'Education', 'Amna Noreen', '6', ' In order for nations to progress, a high-quality educational infrastructure based on equity and equality is stressed upon worldwide, that inculcates the right habits, fosters personality growth and makes one a productive citizen of the state. Huge strides in progress made by the Europeans, especially Germany and the Nordic states are a testament to their exceptional educational system.\r\n\r\nPakistan is faced with a multitude of issues that are deeply rooted and strongly connected with the disparity in educational standards in the country. In fact, the lack of basic education is perhaps the bigger problem out of the two. There are multiple factors behind both the lack of education, and a low standard of education including negligence of past governments towards education, lax attitude of the parents towards getting their children educated, and an insignificant allocation of funds for education in the budget. To make matters worse, even the allocated budget is misused.\r\n\r\nTo improve this situation, the government should implement an educational emergency in collaboration with the private sector. In addition, it should focus on decreasing dropout rates in schools by using new and effective ways of teaching that attract students towards studying such as the use of IT, a uniform education system and removal of imbalance, the addition of equity and accountability,  and finally removal of any financial snags that could deter students from enrolment.\r\n\r\nZharbiz International, an international firm, working towards promotion of education in developing countries, such as the Philippines, plans to assist the Pakistan government in its goal to promote inclusivity and a uniform education system; accessible for all. The organization is basically involved in multiple sectors such as Waste-to-Energy conversion, environment and deployment of commercial drones, besides education.\r\n\r\nIn pursuit of its ambitious goals, the organization envisions introducing a more interactive, transparent, interesting and much advanced Adaptive Education Learning System (AELS) or Zharbiz cleaned learning platform, as the company puts it; a shift from the currently deployed Learning Management System (LMS) in Pakistani educational institutes. Claned was developed by education scientists from Finland in conjunction with top university’s research departments back in 2013. It’s already being used in 40 countries including many in Europe, but now eyeing implementation in South-East Asia.\r\n\r\nWith the help of the platform, the teacher or professor can easily monitor every student in a classroom, getting reports on a daily, weekly basis, or as required to see the progress of students. The platform/software registers when a student signs in shows total time spent on the platform, also shows how often a book was opened during a session, and if there was any difficulty faced during studying. It’s collaborative in nature, e.g. if the students have a question, he doesn’t have to wait for the teacher; another student could also answer the query. Another interesting aspect is that students can measure their progress themselves for the percentage, of course, they’ve completed, also videos and social media links can be added to it, making it more engaging and interesting.\r\n\r\nIt is pertinent to mention here that the Zharbiz-Claned learning platform is already in use by Finnish universities, so the students using it are on a higher level of learning as compared with other children or individuals, also, the system is fun, unlike the one’s currently in use, more importantly, it’s a futuristic cloud-based platform, managed by MS Azure which is scalable to millions of students.\r\n\r\nFurthermore, It motivates kids to study and become self-responsible to educate themselves, which is a big problem in Pakistan. One of the best features of the system is its suitability for schools, colleges and universities alike, as in it can be tailored to suit the needs of the client. Transfer from an LMS based platform to this platform is possible within a couple of days, while the teacher training is again relatively easy.\r\n\r\nMoreover, one of the salient features of the platform is that parents yearning to send their kids abroad for studies won’t need to do so, as the facility would be available in Pakistan.  The organization also plans to set up an open university online in collaboration with top South African and UK universities.\r\n\r\n', 'The views expressed in the article are the author’s own and do not necessarily reflect our editorial stance.', 'faizaliaqat@admin', , '2021-01-31 00:26:42', 110);
INSERT INTO `blogs` (`BlogID`, `Title`, `Category`, `Author`, `AuthorID`, `Blog`, `Disclaimer`, `Admin`, `Pic`, `Date`, `Views`) VALUES
(2192, 'How the tables have turned for Wall Street!', 'Global', 'Waqas Shabbir', '7', 'There will be a bunch of people who will lose millions and their minds – if they haven’t already –until the GameStop saga comes to a logical conclusion. And no one will come to their rescue – unless it is the big funds that lobby and squeeze their way onto the desks of government officials whose tight-fisted manners will have to be put aside if they seriously consider bailing out the Wall Street bankers like they did in 2008.\r\n\r\nBut all that will come later when the share price is defined by what its earnings are, and what its future outlook entails. For now, the chronicles continue even as the share price of GameStop tanks. From $325 on January 29, it has already shed close to three-fourths of its share value after a weekend that probably saw investors tossing and turning, eventually culminating to sleepless nights, wondering where all they went wrong.\r\n\r\nThis is where the model of the stock market comes under the radar. In a stock-market trade, there is always a winner and a loser. This is how it works. You will not sell something today for $4, knowing that it can climb to $6 in a few days. And no one will buy it for $4, knowing that it will fall to $2. However, trades happen due to a variety of reasons – cash requirements, profit-booking, diverting to another share etc. Combine it with how markets behave, and how participants react, you have a disaster recipe when sentiments overpower true fundamentals.\r\n\r\nIn GameStop’s case, there was no fundamental reason for its share price to rise from $4 to over $300 in a matter of months. For context, GameStop is primarily a video game retailer, operating thousands of stores in many countries. With the onset of digital transactions, GameStop’s earnings turned red and revenue dipped by almost a third between 2017 and 2020. It made sense for hedge funds to ‘short it’. This is when you make money as the stock price falls. With the onset of Covid-19, footfall reduced further and online transactions boomed as gamers stayed home and shopped online. Hence, sentiments – that the future for GameStop looks better – were just as misguided.\r\n\r\nHowever, the entire episode is not about fundamentals or technical analysis – two most-favoured terms by stock market participants. This was a much-larger challenge. It was a question put forth by a team or teams of social media users who asked the big funds, ‘can you take a dose of your own medicine’. These funds, for a while now, have led market rallies, squeezed the savings of the common person, and lost little sleep as the world braced itself through a financial crisis.\r\n\r\nThis was a head-on collision but it is still very likely that the savings of the common people will get squeezed yet again. However, big funds scrambled as they were stood up to, challenged, and thrown off their own game – a game they not only played as a club, but by and large won every single time. They did not lose in 2008, when panic ate away small investors and gulped down mid-sized brokerage houses, and they are not going to lose this time either.\r\n\r\nBut what is different this time is the challenge did not come from the regulators who were asleep at the wheel in 2008. It came from average, small-time investors who have absolutely no pull over the market in the strict sense. It came from social media platforms whose power has gone from being used just for laughs to creating absolute panic among the oldest players in the game situated at the trading hub of the world’s largest economy. The average Joe took the bull by the horns, and guided it past a street where cut-throat capitalism has ended careers, pensions, and savings.\r\n\r\nBut after all is said and done, one has to wait to see what changes regulators bring in now. We are already seeing trading apps side with Wall Street. After all, it is those eight blocks that will decide who they want to do business with down the road. The markets will continue to function, and money will continue to be made. But spare a thought for those average investors who entered GameStop at $200 or $300 or $325, and are now staring at their portfolios with remorse, regret, and possibly, anger.\r\n\r\nBut some people have made a lot of money. From $4 to $300, there was wealth-creation for investors at the expense of others. This is what people from the Wall Street do as well. This time, however, it came at their expense. This time, the tables turned. Whatever happens after this, be sure to remember whose side the government, regulators, and the media takes. The stances of these institutions will be enough to understand how the system has worked and how it will continue to work.', 'The views expressed in the article are the author’s own and do not necessarily reflect our editorial stance.', 'faizaliaqat@admin', , '2021-02-03 21:43:45', 83);
INSERT INTO `blogs` (`BlogID`, `Title`, `Category`, `Author`, `AuthorID`, `Blog`, `Disclaimer`, `Admin`, `Pic`, `Date`, `Views`) VALUES
(2193, 'One Nation One Curriculum', 'Education', 'Mehmil Khalid Kunwar', '4', 'IB, Cambridge, Provincial Board systems, Federal Board system, and the multiple conventional Madarassah systems, working simultaneously in a country can bring nothing but disorder. It has always been a challenging question for any parent as to which school and system he should opt for his child’s education. The answer lies in his financial status, his location, his approach towards edification, and of course, the social trends.\r\n\r\nThe implementation of SNC (Single National Curriculum) has triggered a state of panic. People related to education, directly or indirectly, have questions about its workability, sustainability, and practicality. Be it a parent, a student, businessman, economist, political expert, or a religious man, everyone has a lot to say. Where many seem excited and relieved, there are several aggrieved as well. Some see it as a change while others apprehend stagnation. Questions surfacing up vary from person to person. Would it be possible for the government schools to achieve the levels of excellence required by a uniform curriculum?  Would a private school’s student be able to handle certain subjects in Urdu? Would it be wise to pay thousands of rupees to the elite private schools when they’ll be teaching the same curriculum as others? Will the books be properly tailored to bridge the gaps between the multiple education systems? Would it be a good idea to exclude ICT at the primary levels? Would schools be able to do justice to teaching Quran? What about the people who believe that learning Quran in Arabic is futile as it’s the manual about living a life and not reciting without understanding? Will these model books be equally useful in steering the child towards international examinations? Can a child of a poor servant take the same exam as the child of a millionaire? These questions depict our psyche, the mind-sets, the tangible realities, financial divisions, and classes of our society.\r\n\r\n Many portals, platforms, and forums on social media prove that the parent body has never been satisfied with the education situation and systems. A majority of parents are witnessed complaining and showing their disappointment in the curriculum, frameworks, teaching methodologies, and ever-increasing fees. A single curriculum for all has been a constant demand by the stakeholders of the education business i.e., the parents. Mrs. Tooba Tahir, a mother of four says, “Keeping my fingers crossed, I’ve been waiting for this since forever. The existing education system in our country is haywire. Many still struggle to understand the logic and difference between matriculation and O levels! It’s all just business. Due to the negligence and mala-fide intentions of our previous governments, we are exploited by the private schools. They force us to buy books printed at their own printing houses. The curriculums are imported from abroad, hardly custom-designed to fit the requirements of our youth; but bringing huge profits to the schools and an average gain to us.” \r\n\r\nThe deliberate degradation of government schools hasn’t left the people with another choice. Therefore, come hell or high water, every parent tries hard to afford a private school. SNC is a hope that whichever school a parent may choose; the curriculum would be the same. The only concern would be, the quality of tutelage.\r\n\r\n“In a few decades, private schools have very intelligently created a market of their own. With their own standards, their fancy uniforms, their curriculum, and printing houses, they’ve been able to establish small dynasties of their own. The huge banners feel under threat now. Such schools are likely to provoke the parents, instilling fear of a poor career of their children. All we need is to stay put!”, said Mr. Iqbal Hassan (a parent). The arguments and chaos can be seen on social media forums. The nation needs to comprehend that the national curriculum has been designed by collective efforts and most of the renowned scholars and prestigious institutions have contributed to this cause. There are several misconceptions regarding the medium, making it a war between Urdu and English. SNC suggests Islamiat and Social Studies be taught in Urdu whereas, the medium of teaching for the rest of the subjects would be English. People with a progressive attitude think it to be a recessive step. Command over the national language has always been irrelevant in our social philosophy, whereas, English is indispensable as it is generally associated with intellect and competence. Significance and utility of the English language is unquestionable, but marginalizing the local and national languages is also unjustifiable. We have countless examples of people who have studied the local board assigned textbooks and yet accepted by International universities worldwide. The efficacy of any curriculum is contingent upon the execution, and equipping the teachers with the knowledge, attitudes, and skills they require to perform. It’s high time we reject the misconceptions and marketing ploy of the private schools to justify their high fee and flamboyance.\r\n\r\nSNC will reveal the weaknesses in the ever praised multitude of private schools compared to the Urdu medium government schools. It is a composed and balanced step towards synchronizing the categories among our society. It’ll push and pull both the sectors: private and public. Multiple Comparative studies have been carried out, to align SNC with international standards. It includes the analysis and comparison with standards of the UK, Cambridge, Singapore, and Indonesia/Malaysia. A thorough consultation with all the educational sectors and systems is professed on the official website. The four-tiered process comprehensively covers the curriculum documentation, development of the model textbooks, teachers’ training modules, and assessment framework. SNC focuses on defining the framework, specifying the topics. The model books would reassure the achievement of the objectives. The schools would be responsible for teaching whichever way they prefer. They are free to utilize pre-approved extra books, supplementing and supporting the learning process.\r\n\r\nMuch criticism is observed by the modern approach. The content of Islamiat is heavier as compared to the previous syllabi. Along with the Quran Nazra and hifz of surahs, a number of Ahadith are included as well. The lot suggesting comparative religion deems it to be an extreme step. Besides, for a child aiming at O levels, it would be difficult to switch the medium of instruction as all the subjects including Islamiat are taught as well as assessed in English. Furthermore, when it comes to interacting with the world outside Pakistan, our youth should be well versed and competent enough to explain and convey their Islamic beliefs. For that, the basic vocabulary and expression is a must which can only come if they’ve been taught in a language understood by the rest of the world.\r\n\r\nEven after so many years of independence, we have been unable to take pride in our entity. Instead of creating an educational framework on a national level and making it at par with the international levels, we have preferred to copy-paste others. Adopting the curriculum as well as the examination system has made schooling ridiculously expensive. A regular program of O levels costs around seven lakhs per child. The school fees, the extra tuition fees paid to academies, as none of the schools is competent enough to guarantee good grades to a child, the multiple books, and the Cambridge examination fee, PKR17000 for a single subject. How many of us can conveniently afford it? Another obvious side effect is the inequality and confusion deliberately created by the several systems. Why do our students require to testify on the international standards at such young ages? Our local matric system should be competent enough to enable our generations to compete with any foreign assessment system. Besides implementing a uniform framework, there is a need to regulate the teaching tools and methodologies, along with the implementation of a standardized, transparent assessment system. The tarnished board examinations and checking strategies have made our accreditation worthless internationally. People prefer spending a fortune on Cambridge degrees as they believe it to be the only door to explore the foreign academic world.\r\n\r\nThe panic reveals the mistrust of our governmental initiatives, based on past experiences. We’re constantly fed lies and policies go to trash, the moment a government changes.\r\n\r\nMs. Rabia Shuja, a middle school teacher says, \"Once into the system, things will automatically evolve and improve. National curriculums are enforced around the world. Private schools still flourish as they offer a better student-teacher ratio and extracurricular activities. People focused on additional skills always have a choice to add on the electives and individual coaching. Instead of impeding the implementation of a much needed and well-thought project, they should consider the collective benefit.” The panic reveals the mistrust of our governmental initiatives, based on past experiences. We are constantly fed lies and policies are trashed the moment a government changes. Therefore, Pakistanis find it almost impossible to have faith in any reform.\r\n\r\nThe Revolutionary idea of SNC; a single system of education, and a common platform of assessment so that all the children can have a fair and equal opportunity to receive a quality education, is a remarkable effort to bring the whole nation to one page. Fear of the unseen is lethal! A practical solution to resolve the panic would be to go through the contents, action plan, assessment frameworks, teacher training, and overall ecology. The competition between both sectors is very much alive as it is all dependent upon the execution. Besides, the schools focusing on grooming, extra activities, and co-curricular accomplishments would have an edge. Socially, it will improve our image worldwide as nations taking pride in their own identity and language have always earned respect. Let us see what SNC proves to be; Merely another experimentation or an epoch-making move, banishing the social inequality and uplifting all, irrespective of status and position.', 'The views expressed in the article are the author’s own and do not necessarily reflect our editorial stance.', 'faizaliaqat@admin', , '2021-02-05 21:50:08', 70);
INSERT INTO `blogs` (`BlogID`, `Title`, `Category`, `Author`, `AuthorID`, `Blog`, `Disclaimer`, `Admin`, `Pic`, `Date`, `Views`) VALUES
(2194, 'Challenges for Sports Development in Pakistani Universities', 'National', 'Bahadur Ali Khan', '9', 'The Pakistani Nation has the potential to perform in every field of life. But instead of such potential, the outcomes are not satisfactory because of multiple identifiable lacking in policymaking and policy implementation especially in sports. No doubt, national sports bodies lack capacity and competence but the role of educational institutes like schools, colleges and universities in the promotion of sports is not satisfactory. A careful comparison of Pakistani universities with foreign universities candidly shows that a lot of improvement is required sports policy of our universities. With candid and concrete policy, universities also need funds to promote sports by providing suitable sports facilities. Sports may be the last in the priority list of university management. It needs serious attention because universities are like nurseries to provide sportsmen to the national bodies.  A proper vision, well-defined aims and elaborated objectives for sports policy is the need of the hour in higher education institutions in the country.\r\n\r\nIn the first quarter of 2020, Punjab Higher Education Commission established a committee to review and redesign the sports policy. It was hoped that the committee will identify the gaps in the existing policy. It will suggest best practices to the universities to organize their sports departments with proper facilities and qualified HR to produce elite sportspersons and to sever our national sports grid. A careful historical analysis proves that most sports were developed in educational institutions in the 19th century. First time in the history of sports, at Exeter College, Oxford in 1850, the undergraduates decided to adopt a steeplechase and used three feet six inches high agricultural hurdles for a race of 140 yards. The Harrow school in England invested heavily in extending their playing fields from eight acres in 1846 to one hundred and forty-six acres in 1900. The university colleges at Oxford and Cambridge did the same to promote sports. Pierre de Coubertin, the father of modern Olympics, drew heavily on the philosophy of English public schools and universities in drawing up his ideas for the revival of the Olympic Games. It is befitting that the discussion that the revived Olympics took place in June 1894 at the Sorbonne University of Paris. Thus the Olympic movement has its birth in one of the oldest universities in Europe.\r\n\r\nIt is the need of time that Pakistani universities should pay more attention and financial support to sports like physical sciences, humanities and social sciences. Recently, PHEC Sports Committee proposed that HEC must establish a centre of excellence where adequate research and development shall take place in the field of sports sciences, sport management and all allied areas. It is also suggested to develop a pool of qualified sports professionals and develop international linkages with renowned universities worldwide. If HEC develops a pool of high-performance athletes, capable of representing the country in international competitions then it would bring a revolutionary change in the sports paradigm in Pakistan. The committee suggested establishing a sports directorate in each higher education institution to facilitate the sportsmen, building adequate facilities, increasing collaborations and generating funds. It is suggested by the committee to provide medical insurance with monthly scholarships to the deserving athletes so that they can meet their training expenses and tuition fee. It is the responsibility of HEC to monitor the development of sports facilities in all public and private universities. No doubt, the universities have the potential to prepare the sportsmen for national as well as for international sports events. \r\n\r\nNewly established universities have fully engaged in the problems related to infrastructure development, service statutes, development of research facilities, transport, generation of funds and sustainability challenges. In such a hard scenario, it is difficult for universities to allocate suitable funds to develop sports facilities and to facilitate sportsmen. In such universities, commonly the sport\'s development has the least importance. Let us consider a newly developed public sector university, Khwaja Fareed University of Engineering and Information Technology Rahim Yar Khan as a case study. In first-quarter 2020, KFUEIT developed a sports policy under the leadership of newly appointed vice-chancellor Prof. Dr Muhammad Suleman Tahir. A sports directorate was established and skilful sports professionals were appointed as trainers. In the annual budget, suitable funds were allocated for sports development. The development of sports facilities is in transition. University announced sports scholarships and incentives to sportsmen to motivate the students and to attract sportsmen. At the start, the sports directorate focused on the athletics games and start the training of the students. After the hard work of a few months, KFUEIT athletics team participated in a tournament arranged by the District Sports Department and secured the first position with five gold, seven silver and five bronze medals.\r\n\r\nRecently the athletics team of KFUEIT represented District Rahim Yar Khan in Commissioner Cup Sports Gala Athletics Meet 2020 and got 2nd position in the tournament with six gold, two silver and one bronze medal. It is a good strategy to train the sportsmen and test the preparation by participating in district or divisional level competitions. Now the sports team is preparing for the inter-universities championship and university management is confident to get prominent positions in the inter-university championship. No doubt, such outcomes are due to the improved sports policy in KFUEIT. It happened with the special interest of vice-chancellor because in his educational career he was an athlete. He participated in many national level sports events and he also won the title of the best athlete. His special interest and appointment of proper sports professionals revolutionized the sports paradigm in KFUEIT. Indeed, KFUEIT developed a good sports model and Pakistani universities would get benefit by considering the same policy. \r\n\r\nCurrently, Mr Muhammad Anwar Farooq is working as a lecturer in the department of humanities and social sciences, Khwaja Fareed University of Engineering and Information Technology, Rahim Yar Khan, Pakistan. He has fifteen years of teaching and research experience. Currently teaching Philosophy, History and International Relations. He is also the author of four books ‘Logic and Decision Making’, ‘International Relations: An Introduction’, ‘Economic Development in Pakistan’ and ‘Foreign Policy of Pakistan: An Introduction’. Fond of book reading, discussion and travelling. Also, love to write for newspapers and magazines.', 'The views expressed in the article are the author’s own and do not necessarily reflect our editorial stance.', 'faizaliaqat@admin', , '2021-02-05 22:17:15', 37);
INSERT INTO `blogs` (`BlogID`, `Title`, `Category`, `Author`, `AuthorID`, `Blog`, `Disclaimer`, `Admin`, `Pic`, `Date`, `Views`) VALUES
(2195, 'A Multi-Cultural Society is Actually a Rich Society!', 'View Point', 'Mehmil Khalid Kunwar', '4', 'We all are familiar with the fact that the world has become a global village. Today, we are living in a society that comprises of various ethnicities and cultures. It is no denying the fact that there are several benefits that emerge from multicultural environments, for the diversity of the races, cultures, as well as traditions make the society unique as well as attractive. \r\n\r\nTechnology and social media have revolutionised the twenty-first-century. We as Pakistani citizens have to prepare our next generation for a tolerant place. We all should do something for the future to value. We need to ground ourselves not only in our own cultures but also we must approach other cultures in order to understand, represent, and evaluate the remarkably national conditions. When we are exposed to distinctive customs of life, we gain an enormous extent of feelings and lives to discover. This can happen in both a personal and professional approach.\r\n\r\nI am writing this so that you see that meeting diverse races each day is an inordinate treat to be progressive and to acquire an astounding life. It should be a pleasing experience to live in a world that comprises a mixture of several cultures. One of the major benefits is that the inhabitants learn much tolerance on other ethnicities as well as customs. In addition, living in a multicultural social setting may offer an individual the opportunity to enlarge one’s cognitive thinking and also to gain knowledge of remote cultures. Therefore, a multicultural society gives an individual an upper hand in understanding new cultures which raise one’s awareness with regard to the issues of the world. It is also a human desire to acquire new experiences as well as broad knowledge which is well offered by living in a multicultural social setting.\r\n\r\nWith today’s globalisation, connecting people from different parts of the world, societies have become increasingly multicultural. In many ways, it should be seen as a multicultural mosaic, where each culture has a say in creating the picture shown to the world. We need to focus on how every society, living side by side, has to fit and adapt to each other. In the beginning, people may find it difficult to live next to people with another culture for the fear that their norms would crash, and create a divide between them. However, they should try to adapt to each other to live peacefully. In order for a society to function, the different parts, or people, have to co-operate.\r\n\r\nThe impulse to compare is an elementary human attribute. I consider comparison is stimulating and inspiring. Considering the way we are both comparable and diverse makes us better understand the nuances of both experiences whilst indorsing empathy. \r\n\r\nBut where we see multiple benefits, there are few narrow-minded people who think that the culture of the host society would fade away as a result of multiculturalism so they oppose embracing different cultures. Such people view and present ethnic diversity in a manner that affects social trust negatively. The proponents of such arguments support the ideology of differentials, which is a belief that there is a need to differentiate between different ethnicities and cultures in a multicultural society. They are of the view that dissimilar ethnic groups and cultures are unable to coexist. They further amplify their fears by promoting that a multicultural society brings about cultural differences that may divide society. Whereas the major reason behind such division is that one cultural group has a feeling that its religion and culture are superior as compared to the other groups. As a result, ethnic minorities suffer from racial disadvantages in a multi-ethnic setting. It is not only the adults who face this injustice but even the children are not spared and we see this discrimination in the non-provision of basic facilities such as the children’s right to education. Children from minority ethnic groups many a time underperform due to them being in an unfamiliar environment with less recognition of their existence. Therefore, due to cultural differences in a multi-ethnic setting, there is a division in society. It pains me to discover that there are people amongst us who are so discriminating. There is no impairment in taking some time to understand the other person so that one can reduce the chance of distress, nevertheless, I still desire to imagine that the world is a better place when we feel positive about someone notwithstanding his/her cultural upbringing. In actuality, there are people out there who are far superior to who we contemplate they are. We simply fail to realise it for the tags we set before them. It is all about judgment, I presume. We give less significance to certain populaces just because of how they appear. Occasionally, we fail compassion and we are oblivious of it. We should be recapped that multiplicity is not a burden to living liberally but a venture to contact the world.\r\n\r\nDespite having the intention of adapting, cultural differences can create a gap between people. Ignorance and prejudice might be two of the reasons why people find it hard to communicate with others, or do not want to learn more about their neighbouring cultures. As a consequence, we stay away from our neighbors, not wanting to learn about their culture. We think that cultural differences act as a dividing power between people. We should try to understand how people in developed countries, despite being aware of the differences in norms and traditions, choose to overlook them. \r\n\r\nOne can learn much by living in a multicultural society. We should write discourses as well as make movies to try to teach people about the importance of understanding various cultures. We need to focus on how finding the similarities unite people, whereas how not paying attention to other people’s traditions can make adapting even harder. The lesson is, therefore, to try to pay attention to different cultural norms, because when one has knowledge about other people’s cultures, it is easier to understand the different points of view.\r\n\r\nWe can write stories set in a multicultural country, showing various approaches on how to handle cultural differences. As a consequence, one has to take into account the variety of norms and traditions when communicating with others and trying to make a country work as a whole. \r\n\r\nAcquaintance with one’s own tradition is vital, nevertheless what is crucial is sympathy to what the country entails at the moment. It is that realization that makes an individual look external to his own cultural oyster into beneficial facets of other cultures. We should be open to other cultures in order to appreciate, replicate, and review the exceptionally national as well as international situations that are being represented in the written works as well as through electronic media. All inhabitants of Pakistan must go through the course of finding how the  “us” and “them” break down and develop into \"we, the people of Pakistan.\" We need to keep reminding ourselves that the developed countries do not exemplify one culture but integration of their various cultures.\r\n\r\nThe people of Pakistan need to break out of cultural nuisances. We need to decenter our thought. We all need to believe that cultural conflicts take on several forms and have happened in the past too. So all we need is to find out the way to be more open-hearted. It is not only the responsibility of the government. Every individual should perform her/his specific role. History shows that the young generation, especially the students, have always performed an imperative function in improvements and revolts in society. Therefore certainly, students, teachers, working men and women, and also homemakers can and do play a central responsibility in rejoining, inspiring, and supporting the logic of acceptance despite differences amongst the people. We must be more concerned with the forthcoming times. \r\n\r\nInstead of critiquing, we should generate new love and hope amongst all. When the requirement is to accede to our heritages without rebuffing other cultures; we should not attempt to shape ourselves opposing other cultures. We do not want a denunciation of other people in our society, as that would segregate Pakistani people. I, therefore, request for unification with all cultures. We may not want to criticise but we do need to construe the beliefs of our people in minority. As thoughtful national individuals, we need to record the concern, anguish, and irritation of the people living as a minority. Instead of facing a manuscript reviewing history, life, activities, or cultures, we make learning easier by moving a step ahead and trying to understand other ethnicities and cultures and then we live life to the maximum by uniting and involving with people around us. We must avoid the use of markers as these just make the situation worse. To sum this up, living in a society which is multi-ethnic and multi-culture has many advantages for it gives individuals a chance to experience various ways of living through the acquisition of other people’s language, customs, behaviors as well as art. ', 'The views expressed in the article are the author’s own and do not necessarily reflect our editorial stance.', 'faizaliaqat@admin', , '2021-02-06 22:26:18', 24);
INSERT INTO `blogs` (`BlogID`, `Title`, `Category`, `Author`, `AuthorID`, `Blog`, `Disclaimer`, `Admin`, `Pic`, `Date`, `Views`) VALUES
(2198, 'When I interviewed Ali Sadpara...', 'National', 'Mehmil Khalid Kunwar', '4', 'Ali Sadpara, the person for whom every Pakistani has been praying for this week, along with two other climbers has been missing since February 5. The three climbers went for the summit to become only the second team to climb K2 in winters. According to Ali’s son, Sajid Sadpara, he is sure that they summited the mountain but faced some incident while descending from the peak. It is pertinent to mention that Sajid was also part of the team, but returned back to Camp III, after a malfunction in his oxygen mask. \r\n\r\nI had the privilege to talk to Sadpara in 2016, when he and his team became the first ones in the world to summit Nanga Parbat in winters. During that interview, the climber shared his life story, his experiences of climbing and his thoughts about future of climbing in Pakistan. After this interview, Sadpara climbed a number of other mountains, but I am not changing the details. So, here is my tribute to the hero, we didn’t recognize in his life.\r\nPakistan is the home of five out of 14 mountains in the world which are above 8,000 meters. The country definitely is a heaven for the mountain climbers and every year, dozens of mountain climbers and expedition teams come to Pakistan to climb these mountains. Among these mountains, there is the mighty Nanga Parbat with the height of 8,126 meters, second highest of Pakistan and ninth highest of the world. This grand collection of different ridges is known as ‘Killer Mountain’among the climbers. It got its name because 31 climbers died before its first ascend in 1953.\r\n\r\nDespite having this phenomenal nature’s gift of high mountains, the country itself has a serious deprivation in the field of high-altitude climbers. There are names like Samina Baig, Hassan Sadpara and a few others which can be counted on fingertips and Ali Sadpara is one of them. Most of the people came to know about him after he became the member of the first expedition team to summit Nanga Parbat in the winter of 2016.\r\nAli Sadpara from ‘Sadpara village’ of Skardu calls mountain climbing his passion. While talking to me, the climber said that he started as a porter at Boltoro Glacier from 2000 to 2002. “I went there to see my friends who were working as porters and I fell in love with it and I started working as porter. After doing it for two years, I got my job as a high-altitude porter to K-2 in 2004,” he said. “From that point I have been in love with these high snowy palaces. Some people love cars, some love wealth and property, I just love these mountains, they give me peace and tranquility,” he added.\r\n\r\nAbout his climbing experience and achievements, he told methat he has climbed four out of the five highest mountains of Pakistan. “I climbed G-1 in 2010, have climbed G-2 twice, ascended Nanga Parbat in 2008 and 2009, and was in the team which climbed Broad Peak,” he narrated with pride. “On April 2, I am going to Nepal for expeditions of Makalu and ManasluMountains which are eighth and fifth highest mountains of the world respectively,” he said. “My friends and family ask me why I do this, as it has great dangers and I simply say that this part of me is without which I cannot live,” he explained.  \r\nOn a query about how Nanga Parbat is different and difficult from other mountains, he said that apparently it seems to be an easy climb. “Another aspect is that there is very less study on the killer mountain and lack of study makes it more lethal as it has steep climbs especially near its top, has layers of rock and ice which make more difficult to climb on it,” he explained. “These are the conditions of summer and in winter it becomes more icy than snowy, the weather becomes more dangerous due to its ridges and hanging glaciers the avalanches occur more constantly and kill the mountaineers on spot,” he added.\r\n\r\nOn the question of why it has not been ascended in winters he said that again it is about research on this mountain. “I, Alex Txikon, Daniele Nardi, and our other team members have been studying this mountain for the last two to three years. The key is patience, you have to understand the mood of it and secondly, learn from your mistakes like we did. We did not repeat the mistakes which we did last year, like last time we left for summit at 3 AM, this year we left at 6 AM, this year we pitched our camp 100 to 150 meter high from last and many other small things, which led us to a successful summit.”\r\n“The most important thing which I believe is, don’t do it for fame or money, do it with passion and love and you will reach the top,” Ali said. “I have seen my relatives and friends getting rich, getting new cars, properties but I am happier than them because I love what I do and at the end of the day, this is all that matters,” he said.\r\n\r\nAbout the future of climbing in Pakistan, Ali replied that he sees a dark future of climbing as far as Pakistani climbers are concerned. “There are few like me, Hassan Sadpara and Samina Baig, we are almost 10 to 12 high altitude climbers in Pakistan and after us, there is no one,” he replied with melancholy. “It is because of Alpine Club of Pakistan and lack of interest of our government which has done nothing for promotion of climbing among the youth of this country,” he said. “The foreign climbers who came to Pakistan asked us which mountains we have climbed and our experience in it before hiring or making us team members and there is no young climber, unfortunately,” he added. “I have requested the government and I want to deliver my message through media that our youth has immense potential, we even get sponsorships, I just want the Alpine Club and government to establish and train a Pakistani team of climbers,” the climber pleaded. “The Nepali Sherpas have captured our whole climbing industry as the foreign climbers bring them because they are more professional and good climbers,” he added. “Government has to take emergency steps for climbing industry or else we will have only mountains but no mountain climbers.”\r\n“The climbers who summit these mountains take photos of their countries and sponsors on top and as a Pakistani sometimes I cannot do it because I have not been sponsored, In this ascend I got the time to take a photo with Pakistani flag and I cannot even explain the proud feeling, which I had at that moment,” he said. “I just want the government to establish a proper platform for climbers and we will take this field, where it actually is meant to be,” Ali said. “With other foreign teams, we do all the hard work mostly, like placing the rope for climbers but do not get credit because we don’t have government backing,” he added.\r\n\r\nAbout the feeling after reaching the top, Ali me that it is simply out of world and unexplainable. “In the whole world, our country is considered to be territory of terrorists and we have very distorted image but when we go with these foreigners and reach to top, it gives a highly positive message about Pakistan and this is the best feeling,” he said. “I have learnt about life from mountains of Pakistan and I want this land to be appreciated in the world.”\r\nIn the end, I still hope for a miracle, and Sadpara along with his team will reach basecamp. If not, I just want to say, he belonged to mountains, and he is resting there for eternity. K2 has made him a permanent guest. Adios, Sadpara, the son of mountains, who will stay there forever.\r\n \r\n', 'The views expressed in the article are the author’s own and do not necessarily reflect our editorial stance.', 'faizaliaqat@admin', , '2021-02-08 23:34:14', 53);
INSERT INTO `blogs` (`BlogID`, `Title`, `Category`, `Author`, `AuthorID`, `Blog`, `Disclaimer`, `Admin`, `Pic`, `Date`, `Views`) VALUES
(2199, 'How can Pakistan resolve its power sector woes?', 'National', 'Abdul Rehman', '45', 'Amongst the plethora of challenges inherited at the time of assuming power, one of the pressing challenges that the incumbent government had to deal with was a burgeoning circular debt in the power sector. Fast forward two and half-years, the issue has further aggravated to an extent that the national exchequer is at risk of losing billions of dollars in case of default of capacity payments to IPP’s.\r\n\r\nThe recently announced hike in electricity tariffs by Rs. 1.95 per unit poses a significant threat to Pakistan’s economy at a time when the textile exports were gradually picking up after a hiatus owing to the global Covid-19 lockdown. The inflated electricity costs will scale up input costs making the exports non-competitive in international markets. It is perturbing to observe that in the last eighteen months alone, NEPRA has revised power tariffs twenty times citing monthly fuel and quarterly adjustments. Though in its official statements, the incumbent government blames “landmines” left by the previous administration for the power sector’s perennial issues yet the origins of this crisis are deeply embedded in the reckless and uncoordinated energy policies followed for the last twenty-six years.\r\n\r\nPakistan’s first energy policy was formulated in 1994 (almost 47 years after independence) which is a clear testament that energy conservation was under no circumstances a priority of its policymakers. Owing to poor governance and a short-sighted approach, Pakistan’s energy resources have been squandered for decades due to which the nation is confronted with a serious power crisis that has crippled the growth of the manufacturing and services sector and disrupted power supplies in communities and households across the nation. From an economic perspective, it is completely unnerving to witness that the circular debt that stood at Rs.1.2 trillion in 2018 presently stand at a giant Rs.2.3 trillion (as of December 2020), primarily due to the massive subsidies doled out by the government equating to Rs.477 billion during FY-20 alone and an ever-increasing capacity payments that continue to haunt the cause of cost-effective energy production.\r\n\r\nAs per a study conducted last year by an Australia-based Institute for Energy Economics and Financial Analysis, the capacity payments to power generators could touch Rs.1.5 billion ($9 billion) by June 2022 due to massive investments in Thar Coal Power Project and CPEC projects. As per the report submitted by the Committee for Power Sector Audit, Circular Debt Reservation, and Future Roadmap in March 2020 over the state of the power sector in Pakistan, the IPP’s have been earning 50% to 70% of the annual profits in contravention to the 15% limit set by NEPRA. The IPP’s established under the 1994 power policy comprising a pay-back period of two to four years reaped profits averaging 18.26 times the initial investment. The energy policy of 2002 that guaranteed capacity payments and unlimited dollar indexation to induce investors, ultimately created grounds for the massive increase in electricity tariffs and circular debt due to currency exchange rate fluctuations. The Energy Policy of 2009 was again short-sighted in acquiring rental power plants which still evaporate billions of rupees from the national exchequer without producing a single unit of electricity. As per the State Bank of Pakistan’s (SBP) report published in July 2019, the capacity payments to IPP’s were 60% higher than FY 2018 which kept the electricity tariffs on a higher side for end consumers, despite the substantial decline in fuel costs.\r\n\r\nIn the same way, at a time when the economists are urging to improve Pakistan’s ranking in the Ease of Doing Business index, a study by the World Bank reveals, 66.7% of the businesses in Pakistan consider electricity shortages as a more significant impediment to sustainability than corruption (11.7%) and crime/terrorism (5.5 %). As per estimates, the country loses 2% of its GDP due to the existing energy crisis. The Pakistan Economic Survey 2019-20 reveals a 64% increase in electricity generation capacity which spiked from 22,812 MW in June 2013 to 37,402 MW in June 2020. Despite this increase, the country is confronted with an average shortfall of 4000-5000MW which is an offshoot of poor governance as the IPP’s are unable to generate electricity as per their generation capacity. The electricity demand did not scale up as it was expected to do even before the Covid-19 lockdown. Keeping in view these pertinent factors, there is a dire need to induce reforms into the energy sector to scour the country of this looming energy crisis. \r\n\r\nHolistically, to subside the issue to circular debt the policymakers need to take pertinent steps to minimise transmission and distribution losses. In this regard a key solution is to upgrade the fragile transmission and distribution networks through public-private partnerships as adopted by China. Though the government needs a complete privatisation of DISCO’s, yet it will not remain a feasible option in Pakistan as the private investors will seek a neo-liberal profit maximisation model to garner more profits and will be least interested in minimising the electricity tariffs. Inducing private investors to reduce the pilferage and losses in transmission and distribution networks through gradual up-gradation of infrastructure and more rigorous enforcement for bill collection may help reduce the burden of spiraling circular debt. The corporatisation of WAPDA remains another solution to these woes, but it will take some time for the restructuring of WAPDA as a corporate entity and the question remains whether the government will risk their votes by taking over this hard decision expected to invite public resentment.\r\n\r\nTo counter the upcoming debt trap in the power sector the policymakers need to renegotiate the loan terms for the $35 billion CPEC energy projects which currently stand at LIBOR +4.5% to LIBOR +2%, and also restructure the maturity of loans from the existing tenure of 10 years to 20 years. The question remains whether the Chinese investors will give this interest rate concession to Pakistan at a time when hate-mongering is on the rise against Chinese products causing a significant dent in its economy. It is plausible to induce the latest technology into the sector to enhance the energy produced to generate maximum energy output at minimum input costs. Paradoxically, energy efficiency can be used as a tool to minimize both the consumption and generation of energy needed to fuel the economy. There is a dire need that those at the helm of affairs devise and implement policies and mechanisms to counter this power crisis, and regularly monitor the repercussions of these policies to control any unsolicited diversion.', 'The views expressed in the article are the author’s own and do not necessarily reflect our editorial stance.', 'faizaliaqat@admin', , '2021-02-09 13:23:03', 2);

